INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
(914, '_transient_acf_plugin_info_repeater', 'a:17:{s:4:\"name\";s:38:\"Advanced Custom Fields: Repeater Field\";s:4:\"slug\";s:12:\"acf-repeater\";s:8:\"homepage\";s:36:\"http://www.advancedcustomfields.com/\";s:7:\"version\";s:5:\"2.1.0\";s:6:\"author\";s:13:\"Elliot Condon\";s:10:\"author_url\";s:28:\"http://www.elliotcondon.com/\";s:12:\"contributors\";s:12:\"elliotcondon\";s:8:\"requires\";s:5:\"3.6.0\";s:6:\"tested\";s:5:\"4.9.0\";s:4:\"tags\";a:6:{i:0;s:5:\"2.0.1\";i:1;s:11:\"2.0.0-beta2\";i:2;s:11:\"2.0.0-beta1\";i:3;s:5:\"2.0.0\";i:4;s:5:\"1.1.1\";i:5;s:5:\"1.0.1\";}s:6:\"tagged\";s:0:\"\";s:11:\"description\";s:371:\"<p>The Repeater field acts as a table of data where you can define the columns (sub fields) and add infinite rows.</p>\n<p>Any type of field can be added as a sub field which gives you the potential to create very flexible templates.</p>\n<p><a href=\"http://www.advancedcustomfields.com/add-ons/repeater-field/\">www.advancedcustomfields.com/add-ons/repeater-field/</a></p>\n\";s:12:\"installation\";s:833:\"<p>This software can be treated as both a WP plugin and a theme include.</p>\n<p>However, only when activated as a plugin will updates be available/</p>\n<h4> Plugin </h4><ol><li>Copy the <code>acf-repeater</code> folder into your plugins folder</li><li>Activate the plugin via the Plugins admin page</li></ol><h4> Include </h4><ol><li>Copy the <code>acf-repeater</code> folder into your theme folder (can use sub folders)</li></ol>   * You can place the folder anywhere inside the <code>wp-content</code> directory<ol><li>Edit your functions.php file and add the following code to include the field:</li></ol>`\n<p>include_once(<code>acf-repeater/acf-repeater.php</code>);</p>\n<p>`<ol><li>Make sure the path is correct to include the acf-repeater.php file</li><li>Remove the acf-repeater-update.php file from the folder.</li></ol></p>\n\";s:9:\"changelog\";s:1735:\"<h4> 2.1.0 </h4>\n<ul><li>Added support for ACF version 5.7.0</li></ul>\n<h4> 2.0.1 </h4>\n<ul><li>Minor fixes and improvements</li></ul>\n<h4> 2.0.0 </h4>\n<ul><li>Added support for ACF version 5</li></ul>\n<h4> 1.1.1 </h4>\n<ul><li>Fixed CSS bug causing any nested flexible content fields to not display add/remove buttons for each layout</li><li>Fixes CSS bug causing cropped tables on small screen sizes</li></ul>\n<h4> 1.1.0 </h4>\n<ul><li>Added Support for sub field conditional logic</li><li>Added Support for sub field required validation</li><li>Updated UI for <code>column width</code> option (prepend %)</li><li>Updated UI for <code>Maximum Rows</code> option (can be left blank)</li><li>Updated JS to use .on function instead of .live</li><li>Added new update script allowing distribution in premium plugins / themes</li></ul>\n<h4> 1.0.1 </h4>\n<ul><li>[Updated] Updated sub field type list to remove <code>Tab</code> as this does not work as a sub field</li></ul>\n<h4> 1.0.0 </h4>\n<ul><li>[Updated] Updated update_field parameters</li><li>Official Release</li></ul>\n<h4> 0.1.2 </h4>\n<ul><li>[IMPORTANT] This update requires the latest ACF v4 files available on GIT - <a href=\"https://github.com/elliotcondon/acf4\">github.com/elliotcondon/acf4</a></li><li>[Added] Added category to field to appear in the <code>Layout</code> optgroup</li><li>[Updated] Updated dir / path code to use acf filter</li></ul>\n<h4> 0.1.1 </h4>\n<ul><li>[IMPORTANT] This update requires the latest ACF v4 files available on GIT - <a href=\"https://github.com/elliotcondon/acf4\">github.com/elliotcondon/acf4</a></li><li>[Updated] Updated naming conventions in field group page</li></ul>\n<h4> 0.1.0 </h4>\n<ul><li>[Fixed] Fix wrong str_replace in $dir</li></ul>\n\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:1:{s:7:\"default\";s:66:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg\";}}', 'no'),
