(3725, 187, '_rows_0_wrap', 'field_5b3f7a62cb1dd'),
(3726, 187, 'rows_0_hide', ''),
(3727, 187, '_rows_0_hide', 'field_5b6ad3eb4a2b8'),
(3728, 187, 'rows_0_col1', 'At the core of Perrigo’s success is our unwavering focus on and execution of our five strategic pillars -- Quality, Customer Service, Innovation, Cost Effectiveness and People – the fundamentals that we consider the foundation of our business.\r\n\r\nQuality\r\nWhile the concept of quality is very broad, we define it as delivering to our customers and consumers safe, effective, and trustworthy products and services that meet their expectations every time.\r\nWe make products that are consumed by our families and neighbors, as well as by people around the world. That is why we are uncompromising in our expectations to deliver high quality products to the market. Everyone at Perrigo takes responsibility for ensuring that we develop and manufacture products of the highest possible quality, and that we meet or exceed regulatory requirements.\r\n\r\nCustomer Service\r\nCustomer Service refers to how Perrigo treats its customers and how well we deliver on our promises to them. We focus on developing strong relationships with our customers and fostering a high-performing work environment with a strong commitment to customer service.\r\nOur ability to deliver excellent customer service is also supported by the use of Lean Sigma processes and tools, and relationship-building with external suppliers in order to reduce supply problems that can lead to customer service issues.\r\n\r\nInnovation\r\nIn order for Perrigo to maintain steady growth and remain profitable, we need a steady flow of new products. That is why innovation is an important part of our business strategy. Our innovation efforts focus on leveraging our ability to develop and produce a wide range of over-the-counter products, prescription products, infant formula and niche active pharmaceutical ingredients. And because we have a unique capability to develop a variety of different dosage forms, we are able to look at a broad range of opportunities to fuel our growth.\r\n\r\nCost Effectiveness\r\nPerrigo closely manages the costs of manufacturing our products as well as our purchased goods and services. By focusing on the right things and executing them the right way, we make the best use of our resources and ensure our ability to offer our customers the highest-quality products at an affordable cost.\r\n\r\nPeople\r\nPeople make things happen at Perrigo. Our employees provide high-quality products, identify cost-effective solutions, improve our processes, and support our communities. To support them, we foster an environment based on integrity, respect, and responsibility. We strive to offer competitive pay and benefits, as well as robust development programs that help them pursue a satisfying career and build our pipeline of talent needed to support global expansion.'),
