(6405, 295, '_rows_3_stylise_columns', 'field_5b7590080f0f5'),
(6406, 295, 'rows_3_col1', '<p style=\"text-align: center;\">Perrigo\'s core values of integrity, respect, and responsibility guide how employees should interact with each other as we conduct Perrigo business. In addition to these, in the UK &amp; Ireland, we have a set of attributes that encapsulate how we want to do business. We use the following four behaviours to challenge ourselves and each other daily – these are part of our culture.</p>\r\n<p style=\"text-align: center;\"><strong>We lead with honesty</strong></p>\r\n\r\n<ul style=\"text-align: center;\">\r\n 	<li>We collaborate</li>\r\n 	<li>We are honest, open and true to ourselves</li>\r\n 	<li>We command respect from those we work with</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong>We are proud to care</strong></p>\r\n\r\n<ul style=\"text-align: center;\">\r\n 	<li>We are principled in our actions and uncompromising in our delivery</li>\r\n 	<li>What we do is meaningful and we care about what we do</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong>We think smart</strong></p>\r\n\r\n<ul style=\"text-align: center;\">\r\n 	<li>We are savvy and our approaches are agile</li>\r\n 	<li>We seek the extraordinary and relentlessly focus on what makes a difference</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong>We aim for the top</strong></p>\r\n\r\n<ul style=\"text-align: center;\">\r\n 	<li>We are imaginative</li>\r\n 	<li>We rise to a challenge and strive to be the best we can be</li>\r\n</ul>\r\n<h4 style=\"text-align: center;\">Five strategic pillars</h4>\r\n<ul style=\"text-align: center;\">\r\n 	<li>At the core of Perrigo’s success is our unwavering focus on and execution of our five strategic pillars -- Quality, Customer Service, Innovation, Cost Effectiveness and People – the fundamentals that we consider the foundation of our business.</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong>Quality</strong>\r\nWhile the concept of quality is very broad, we define it as delivering to our customers and consumers safe, effective, and trustworthy products and services that meet their expectations every time.\r\nWe make products that are consumed by our families and neighbors, as well as by people around the world. That is why we are uncompromising in our expectations to deliver high quality products to the market. Everyone at Perrigo takes responsibility for ensuring that we develop and manufacture products of the highest possible quality, and that we meet or exceed regulatory requirements.</p>\r\n<p style=\"text-align: center;\"><strong>Customer Service</strong>\r\nCustomer Service refers to how Perrigo treats its customers and how well we deliver on our promises to them. We focus on developing strong relationships with our customers and fostering a high-performing work environment with a strong commitment to customer service.\r\nOur ability to deliver excellent customer service is also supported by the use of Lean Sigma processes and tools, and relationship-building with external suppliers in order to reduce supply problems that can lead to customer service issues.</p>\r\n<p style=\"text-align: center;\"><strong>Innovation</strong>\r\nIn order for Perrigo to maintain steady growth and remain profitable, we need a steady flow of new products. That is why innovation is an important part of our business strategy. Our innovation efforts focus on leveraging our ability to develop and produce a wide range of over-the-counter products, prescription products, infant formula and niche active pharmaceutical ingredients. And because we have a unique capability to develop a variety of different dosage forms, we are able to look at a broad range of opportunities to fuel our growth.</p>\r\n<p style=\"text-align: center;\"><strong>Cost Effectiveness</strong>\r\nPerrigo closely manages the costs of manufacturing our products as well as our purchased goods and services. By focusing on the right things and executing them the right way, we make the best use of our resources and ensure our ability to offer our customers the highest-quality products at an affordable cost.</p>\r\n<p style=\"text-align: center;\"><strong>People</strong>\r\nPeople make things happen at Perrigo. Our employees provide high-quality products, identify cost-effective solutions, improve our processes, and support our communities. To support them, we foster an environment based on integrity, respect, and responsibility. We strive to offer competitive pay and benefits, as well as robust development programs that help them pursue a satisfying career and build our pipeline of talent needed to support global expansion.</p>'),
