(6591, 296, '_rows_3_stylise_columns', 'field_5b7590080f0f5'),
(6592, 296, 'rows_3_col1', '<p class=\"copy-l\" style=\"text-align: center;\"><span style=\"color: #00a5db;\">Perrigo\'s core values of integrity, respect, and responsibility guide how employees should interact with each other as we conduct Perrigo business. In addition to these, in the UK &amp; Ireland, we have a set of attributes that encapsulate how we want to do business. We use the following four behaviours to challenge ourselves and each other daily – these are part of our culture.</span></p>\r\n<p style=\"text-align: center;\"><strong>We lead with honesty</strong></p>\r\n<p style=\"text-align: center;\">We collaborate\r\nWe are honest, open and true to ourselves\r\nWe command respect from those we work with</p>\r\n<p style=\"text-align: center;\"><strong>We are proud to care</strong></p>\r\n<p style=\"text-align: center;\">We are principled in our actions and uncompromising in our delivery\r\nWhat we do is meaningful and we care about what we do</p>\r\n<p style=\"text-align: center;\"><strong>We think smart</strong></p>\r\n<p style=\"text-align: center;\">We are savvy and our approaches are agile\r\nWe seek the extraordinary and relentlessly focus on what makes a difference</p>\r\n<p style=\"text-align: center;\"><strong>We aim for the top</strong></p>\r\n<p style=\"text-align: center;\">We are imaginative\r\nWe rise to a challenge and strive to be the best we can be</p>'),
