(6760, 298, 'rows_0_col2_b', '<h2>Respect</h2>\r\nWe demonstrate the value we hold for one another\r\n<ul>\r\n 	<li class=\"p1\">We act with respect towards our colleagues and others with whom we interact.</li>\r\n 	<li class=\"p1\">We communicate openly and candidly and address our differences professionally.</li>\r\n 	<li class=\"p1\">We emphasise teamwork, value each person’s contribution, and collaborate in confidence and trust.</li>\r\n</ul>'),
