(7692, 315, '_rows_1_col2_a', 'field_5afc1d5377255'),
(7693, 315, 'rows_1_col2_b', '<h2>Integrity</h2>\r\nWe do what is right\r\n<ul>\r\n 	<li class=\"p1\">We are committed to conducting our business with individual and organisational integrity.</li>\r\n 	<li class=\"p1\">We comply with the law and avoid conflicts of interest.</li>\r\n 	<li class=\"p1\">We are reliable, honest and trustworthy in our dealings.</li>\r\n</ul>'),
