(8484, 328, 'rows_1_col1', '<ul>\r\n 	<li>The Rosemont Commitment</li>\r\n</ul>\r\n<ul>\r\n 	<li><strong>Extensive Product range</strong> – liquid medicines for many therapeutic areas including cardiovascular, endocrine, central nervous system, gastro-intestinal and musculo-skeletal.</li>\r\n 	<li><strong>Exceptional Product quality</strong> – we produce all our medicines to the same exacting GMP standards, so whether they are licensed products or \'Specials\' the quality will be the same through batch manufacturing.</li>\r\n 	<li><strong>Reliable delivery</strong> – delivery within 48 hours in over 99% of orders and within 24 hours available on request.</li>\r\n 	<li><strong>Outstanding Customer Service</strong> – dedicated and knowledgeable customer service team who provide expert support for our customers</li>\r\n 	<li><strong>Proven Shelf life</strong> – for both licensed and \'Specials\'. Generally our \"Specials\" have a minimum 9 month shelf life.</li>\r\n 	<li><strong>Award-winning Educational Resources</strong> – we are a key partner in the education of healthcare professionals in the field of medicines management in patients with dysphagia or swallowing difficulties. We have a wide range of resources designed to help healthcare professionals deliver the best possible care. Also, extensively researched patient information leaflets.</li>\r\n 	<li><strong>Healthcare professional advice service</strong> – 24 hour professional advice line available 365 days a year.</li>\r\n</ul>'),
