(8528, 329, 'rows_0_col2_a', '<h3><span style=\"color: #283371;\">Serving Patient Needs</span></h3>\r\n<p class=\"p1\">Dysphagia or swallowing difficulty preventing patients taking their medication can be associated with many reasons, for example:</p>\r\n\r\n<ul>\r\n 	<li>Stroke</li>\r\n 	<li>Parkinson\'s disease</li>\r\n 	<li>Alzheimer\'s or dementia</li>\r\n 	<li>Old age, loss of muscle tone, less saliva being produced</li>\r\n 	<li>Head and neck cancer</li>\r\n 	<li>Cerebral palsy</li>\r\n 	<li>Learning disability</li>\r\n 	<li>Children unwilling or unable to swallow tablets designed for adults</li>\r\n</ul>'),
(8529, 329, '_rows_0_col2_a', 'field_5afc1d5377255'),
