(8744, 332, 'rows_0_col2_a', '<h3>Serving Patient Needs</h3>\r\n<p class=\"p1\">Dysphagia or swallowing difficulty preventing patients taking their medication can be associated with many reasons, for example:</p>\r\n\r\n<ul>\r\n 	<li>Stroke</li>\r\n 	<li>Parkinson\'s disease</li>\r\n 	<li>Alzheimer\'s or dementia</li>\r\n 	<li>Old age, loss of muscle tone, less saliva being produced</li>\r\n 	<li>Head and neck cancer</li>\r\n 	<li>Cerebral palsy</li>\r\n 	<li>Learning disability</li>\r\n 	<li>Children unwilling or unable to swallow tablets designed for adults</li>\r\n</ul>'),
(8745, 332, '_rows_0_col2_a', 'field_5afc1d5377255'),
(8746, 332, 'rows_0_col2_b', '<h3>Extensive Product Range</h3>\r\nOur products can be used across a wide range of therapeutic areas including:\r\n<ul>\r\n 	<li>Anaethesia</li>\r\n 	<li>Cardiovascular</li>\r\n 	<li>Central Nervous System</li>\r\n 	<li>Endocrine</li>\r\n 	<li>Gastro-Intestinal System</li>\r\n 	<li>Infection</li>\r\n 	<li>Malignant Disease &amp; Immunosuppression</li>\r\n 	<li>Musculoskeletal System</li>\r\n 	<li>Nutrition and Blood</li>\r\n 	<li>Obstetrics, Gynaecology and Urinary-Tract Disorders</li>\r\n</ul>'),
