(9411, 341, 'rows_0_col1', '<h3>Our Services</h3>\r\n<p class=\"p1\">We supply and manufacture a broad range of OTC and healthcare products. Our highly trained staff provide expertise and support in the following areas:</p>\r\n\r\n<ul class=\"col-6\">\r\n 	<li class=\"p1\">New product development</li>\r\n 	<li class=\"p1\">Validation</li>\r\n 	<li class=\"p1\">Process support</li>\r\n 	<li class=\"p1\">Packaging solutions</li>\r\n 	<li class=\"p1\">Artwork and origination</li>\r\n 	<li class=\"p1\">Promotion and advertising assistance</li>\r\n 	<li class=\"p1\">Licence applications</li>\r\n 	<li class=\"p1\">UK Regulatory legislation</li>\r\n 	<li class=\"p1\">Warehousing</li>\r\n</ul>'),
