(9513, 342, 'rows_1_col1', '<h3><span style=\"color: #283371;\">Our Success is Built on...</span></h3>\r\n<strong>High Quality</strong>\r\nIndependently Approved by: MHRA, GMP, BSi ISO 9001:2008 &amp; ISO 13485:2003 BRC Global standard Consumer Products and Investor in People Committed to social &amp; ethical practices and the ETI base code (Ethical Trading Initiative)\r\n\r\n<strong>Excellent Service</strong>\r\n‘Supplier of the year’ awards – GSK &amp; Tesco\r\n‘Best Process Factory’ award - Management Today magazine\r\n\r\n<strong>Low Cost</strong>\r\nGlobal buying power and Manufacturing efficiencies\r\n\r\n<strong>Innovative Products</strong>\r\nSignificant investment into NPD\r\n\r\n<strong>Building Long Term Business</strong>\r\n\r\n&nbsp;\r\n<h2><span style=\"color: #283371;\">Manufacturing &amp; Packaging</span></h2>\r\n<p class=\"p copy-l\"><span style=\"color: #00a5db;\">Our Manufacturing &amp; Packaging site operates to highest pharmaceutical GMP standards and has UK regulatory approval.</span></p>\r\n\r\n<h3><span style=\"color: #283371;\">Manufacturing</span></h3>\r\nUsing a range of mixing vessels and presses, a variety of formulation types can be manufactured:\r\n<ul>\r\n 	<li>Liquid products including: alcohol, water or oil based liquids, lotions, ointments, creams, toothpaste, lip balms, suppositories, gels and pastes.</li>\r\n 	<li>Dry products including: tablets, capsules and powders / granules.</li>\r\n</ul>\r\n<h3><span style=\"color: #283371;\">Product Formats</span></h3>\r\nPerrigo can offer a wide variety of product formats including:\r\n<ul>\r\n 	<li>Liquids - (water, alcohol and oil based)</li>\r\n 	<li>Tablets (uncoated / coated)</li>\r\n 	<li>Caplets (uncoated / coated)</li>\r\n 	<li>Two-piece capsules</li>\r\n 	<li>Lozenges</li>\r\n 	<li>Creams</li>\r\n 	<li>Ointments</li>\r\n 	<li>Gels</li>\r\n 	<li>Lotions</li>\r\n 	<li>Powders</li>\r\n 	<li>Granules</li>\r\n 	<li>Suppositories</li>\r\n 	<li>Paste</li>\r\n</ul>\r\n<h3><span style=\"color: #283371;\">Packaging Types</span></h3>\r\nPerrigo can offer a wide variety of packaging types to meet your individual needs:\r\n<ul>\r\n 	<li>Blisters (including tablets and</li>\r\n 	<li>capsules in 0, 1 &amp; 2 capsule sizes)</li>\r\n 	<li>Cartons</li>\r\n 	<li>Roll-wraps sleeves</li>\r\n 	<li>Sachets / laminates</li>\r\n 	<li>Bottles</li>\r\n 	<li>Jars</li>\r\n 	<li>Pots</li>\r\n 	<li>Form-fill-seal</li>\r\n 	<li>Tubes</li>\r\n 	<li>Tubs</li>\r\n</ul>\r\n<h3><span style=\"color: #283371;\">Distribution</span></h3>\r\nPerrigo has developed a unique business in providing tailored solutions for our customer\'s packing, fulfilment and storage in our state-of-the-art warehouses and distribution requirements via our fleet of specialist vehicles. We offer expert advice and support throughout the processing and delivery of our customer orders.\r\n<em><strong>Our aim is to work as part of your team — to provide a seamless link with your business, to develop a strong and full understanding of your business objectives, and to ultimately provide a fast, friendly, and cost-effective service.</strong></em>\r\n\r\n&nbsp;\r\n<h2><span style=\"color: #283371;\">Licensing &amp; Development</span></h2>\r\n<p class=\"copy-l\"><span style=\"color: #00a5db;\">Our Regulatory team, working closely with the UK Regulatory Authority and other competent authorities, strives to ensure that all legal obligations are met, while continuing to maintain our high levels of quality.</span></p>\r\nOur team of Artwork Coordinators ensures the smooth operation of all aspects of artwork origination and licensing, as well as the preparation of artwork and supporting documentation.\r\n\r\n<strong>Active in all major OTC therapeutic areas:</strong>\r\n<ul>\r\n 	<li>Analgesics</li>\r\n 	<li>Cough, cold &amp; flu</li>\r\n 	<li>Hayfever &amp; allergy</li>\r\n 	<li>Gastrointestinal</li>\r\n 	<li>Nicotine Replacement therapy</li>\r\n 	<li>Antifungals</li>\r\n 	<li>Diagnostic tests</li>\r\n 	<li>Sleeping aids</li>\r\n 	<li>Female health</li>\r\n 	<li>Hair care</li>\r\n</ul>\r\n<strong>Flexibility &amp; Variety:</strong>\r\n\r\nPerrigo offers a broad and exclusive portfolio of branded products with a wide range of OTC products in the UK. We also have access to many other products under licence from our supply partners. Most of our products are available on general sale from supermarkets, drugstores, pharmacies and other outlets. However, some are only available at pharmacies, which is indicated in their description.\r\n\r\n<strong>Export Products</strong>\r\n\r\nFor full details of our products available for export, please get in touch through our <a href=\"https://www.perrigouk.co.uk/contact/enquiry.aspx\">New Project Enquiry Page</a> or <a href=\"https://www.perrigouk.co.uk/contact/default.aspx\">Contact us</a> page.\r\n\r\n<strong>Development</strong>\r\n\r\nAt Perrigo, we are committed to providing a regular flow of new products in OTC Healthcare designed to support the business development aspirations of our customers.\r\n\r\nOur specialist in-house development laboratory, with its dedicated team of experienced chemists, provides fast track development of new products.'),
