(10251, 346, 'rows_10_col1', '<ul class=\"flair\">\r\n 	<li>\r\n<h4>Flexibility &amp; Variety:</h4>\r\nPerrigo offers a broad and exclusive portfolio of branded products with a wide range of OTC products in the UK. We also have access to many other products under licence from our supply partners. Most of our products are available on general sale from supermarkets, drugstores, pharmacies and other outlets. However, some are only available at pharmacies, which is indicated in their description.</li>\r\n 	<li>\r\n<h4>Export Products</h4>\r\nFor full details of our products available for export, please get in touch through our <a href=\"https://www.perrigouk.co.uk/contact/enquiry.aspx\">New Project Enquiry Page</a> or <a href=\"https://www.perrigouk.co.uk/contact/default.aspx\">Contact us</a> page.</li>\r\n 	<li>\r\n<h4>Development</h4>\r\nAt Perrigo, we are committed to providing a regular flow of new products in OTC Healthcare designed to support the business development aspirations of our customers.Our specialist in-house development laboratory, with its dedicated team of experienced chemists, provides fast track development of new products.</li>\r\n</ul>'),
