(10593, 347, 'rows_3_col1', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Our Manufacturing &amp; Packaging site operates to highest pharmaceutical GMP standards and has UK regulatory approval.</span></h2>\r\nHaving collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.'),
