(10653, 347, 'rows_5_col1', '<h3>Packaging Types</h3>\r\nPerrigo can offer a wide variety of packaging types to meet your individual needs:\r\n<ul class=\"col-2\">\r\n 	<li>Blisters (including tablets and</li>\r\n 	<li>capsules in 0, 1 &amp; 2 capsule sizes)</li>\r\n 	<li>Cartons</li>\r\n 	<li>Roll-wraps sleeves</li>\r\n 	<li>Sachets / laminates</li>\r\n 	<li>Bottles</li>\r\n 	<li>Jars</li>\r\n 	<li>Pots</li>\r\n 	<li>Form-fill-seal</li>\r\n 	<li>Tubes</li>\r\n 	<li>Tubs</li>\r\n</ul>'),
