(10683, 347, 'rows_6_col1', '<h3>Distribution</h3>\r\nPerrigo has developed a unique business in providing tailored solutions for our customer\'s packing, fulfilment and storage in our state-of-the-art warehouses and distribution requirements via our fleet of specialist vehicles. We offer expert advice and support throughout the processing and delivery of our customer orders.\r\n<em><strong>Our aim is to work as part of your team — to provide a seamless link with your business, to develop a strong and full understanding of your business objectives, and to ultimately provide a fast, friendly, and cost-effective service.</strong></em>'),
