(10743, 347, 'rows_8_col1', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Our Regulatory team, working closely with the UK Regulatory Authority and other competent authorities, strives to ensure that all legal obligations are met, while continuing to maintain our high levels of quality.</span></h2>\r\nOur team of Artwork Coordinators ensures the smooth operation of all aspects of artwork origination and licensing, as well as the preparation of artwork and supporting documentation.'),
