(11901, 360, 'rows_4_col1', '<h3>Product Formats</h3>\r\nPerrigo can offer a wide variety of product formats including:\r\n<ul class=\"col-2\">\r\n 	<li>Liquids - (water, alcohol and oil based)</li>\r\n 	<li>Tablets (uncoated / coated)</li>\r\n 	<li>Caplets (uncoated / coated)</li>\r\n 	<li>Two-piece capsules</li>\r\n 	<li>Lozenges</li>\r\n 	<li>Creams</li>\r\n 	<li>Ointments</li>\r\n 	<li>Gels</li>\r\n 	<li>Lotions</li>\r\n 	<li>Powders</li>\r\n 	<li>Granules</li>\r\n 	<li>Suppositories</li>\r\n 	<li>Paste</li>\r\n</ul>'),
