(12051, 360, 'rows_9_col1', '<h3>Active in all major OTC therapeutic areas:</h3>\r\n<ul class=\"col-2\">\r\n 	<li>Analgesics</li>\r\n 	<li>Cough, cold &amp; flu</li>\r\n 	<li>Hayfever &amp; allergy</li>\r\n 	<li>Gastrointestinal</li>\r\n 	<li>Nicotine Replacement therapy</li>\r\n 	<li>Antifungals</li>\r\n 	<li>Diagnostic tests</li>\r\n 	<li>Sleeping aids</li>\r\n 	<li>Female health</li>\r\n 	<li>Hair care</li>\r\n</ul>'),
