(12532, 370, '_rows_1_stylise_columns', 'field_5b7590080f0f5'),
(12533, 370, 'rows_1_col1', '<h4>Our locations</h4>\r\nWe are lucky enough to have approximately 10,000 colleagues doing amazing things in over 30 countries, spread across the globe. This includes the UK and Ireland, but also America, Australia, India, Israel, plus much of Europe.\r\n\r\nThis means a world of job opportunities will be open to you. We encourage internal recruitment and are proud of our commitment to supporting the mobility of our people.\r\n\r\n<strong>In the UK</strong>\r\nWe have 5 sites in the UK across Leeds, Barnsley, Braunton and two in London with our Global Headquarters based in Ireland.\r\n<h4>Our roles</h4>\r\nColleagues undertake a range of roles from marketing to regulatory and scientific affairs, to manufacturing, engineering and quality, to finance and design. Plus more!\r\n\r\n<span style=\"color: #283371;\"><strong>Sound interesting? Take a look at our current vacancies to see if we have a job for you.</strong></span>\r\n\r\n<a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a>'),
