(13314, 377, '_rows_3_col2_a', 'field_5afc1d5377255'),
(13315, 377, 'rows_3_col2_b', '<h2>Responsibility</h2>\r\nWe hold ourselves accountable for our actions\r\n<ul>\r\n 	<li class=\"p1\">We accept personal responsibility for everything that we do and we lead by example.</li>\r\n 	<li class=\"p1\">We treat the Company’s reputation as our own and try to make wise use of our time and the Company’s resources.</li>\r\n 	<li class=\"p1\">We take responsibility for performing at our best and strive to achieve our own and the Company’s potential.</li>\r\n 	<li>We are committed to a culture of shared responsibility that promotes a safe, healthy and high performing workforce.</li>\r\n</ul>'),
