(15733, 449, 'rows_2_col2_a', '<ul class=\"flair\">\r\n 	<li>\r\n<h4>Extensive Product range</h4>\r\nLiquid medicines for many therapeutic areas including cardiovascular, endocrine, central nervous system, gastro-intestinal and musculo-skeletal.</li>\r\n 	<li>\r\n<h4>Reliable delivery</h4>\r\nDelivery within 48 hours in over 99% of orders and within 24 hours available on request.</li>\r\n 	<li>\r\n<h4>Healthcare professional advice service</h4>\r\n24 hour professional advice line available 365 days a year.</li>\r\n 	<li>\r\n<h4>Proven Shelf life</h4>\r\nFor both licensed and ‘Specials’. Generally our “Specials” have a minimum 9 month shelf life.</li>\r\n</ul>'),
(15734, 449, '_rows_2_col2_a', 'field_5afc1d5377255'),
(15735, 449, 'rows_2_col2_b', '<ul class=\"flair\">\r\n 	<li>\r\n<h4>Exceptional Product quality</h4>\r\nWe produce all our medicines to the same exacting GMP standards, so whether they are licensed products or ‘Specials’ the quality will be the same through batch manufacturing.</li>\r\n 	<li>\r\n<h4>Outstanding Customer Service</h4>\r\nDedicated and knowledgeable customer service team who provide expert support for our customers.</li>\r\n 	<li>\r\n<h4>Award-winning Educational Resources</h4>\r\nWe are a key partner in the education of healthcare professionals in the field of medicines management in patients with dysphagia or swallowing difficulties. We have a wide range of resources designed to help healthcare professionals deliver the best possible care. Also, extensively researched patient information leaflets.</li>\r\n</ul>'),
