(17407, 477, 'rows_1_col1', '<ol class=\"features-list inline\">\r\n 	<li>\r\n<h4>High Quality</h4>\r\nIndependently Approved by: MHRA, GMP, BSi ISO 9001:2008 &amp; ISO 13485:2003 BRC Global standard Consumer Products and Investor in People Committed to social &amp; ethical practices and the ETI base code (Ethical Trading Initiative)</li>\r\n 	<li>\r\n<h4>Excellent Service</h4>\r\n‘Supplier of the year’ awards – GSK &amp; Tesco\r\n‘Best Process Factory’ award - Management Today magazine</li>\r\n 	<li>\r\n<h4>Low Cost</h4>\r\nGlobal buying power and Manufacturing efficiencies</li>\r\n 	<li>\r\n<h4>Innovative Products</h4>\r\nSignificant investment into NPD</li>\r\n 	<li>\r\n<h4>Building Long Term Business</h4>\r\n</li>\r\n</ol>'),
