(6, 1, '2018-07-19 11:54:26', '2018-07-19 10:54:26', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Leicester City, XYZ employs over 2,000 people and does all kinds of awesome things for the Leicester community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://perrigo.honeydigital.co.uk/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Perrigo', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-07-19 11:54:26', '2018-07-19 10:54:26', '', 2, 'http://perrigo.honeydigital.co.uk/2018/07/19/2-revision-v1/', 0, 'revision', '', 0),
(8, 1, '2018-07-19 11:57:17', '2018-07-19 10:57:17', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Perrigo is one of the fastest growing healthcare companies in the world, and an in-dustry leader in pharmaceutical technologies. We develop, manufacture and dis-tribute over-the-counter (OTC) branded and non-branded consumer goods, as well as prescription (Rx) pharmaceuticals.</span></h2>\r\nYou may have heard of some of our iconic household brands including Nytol, Solpadeine, Tiger Balm, NiQuitin, Jungle Formula, Dermalex, XLS-Medical and family favourite TCP. We also produce over 160 liquid medicines helping to treat a variety of conditions, such as musculoskeletal and joint diseases, cardiovascular disease, infections, swallowing problems and more.\r\n\r\nAt Perrigo, we are unapologetically passionate about making a difference to health - relentlessly making quality healthcare products accessible and affordable for people around the world.', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2018-08-29 18:07:41', '2018-08-29 17:07:41', '', 0, 'http://perrigo.honeydigital.co.uk/?page_id=8', 0, 'page', '', 0),
