(10, 1, '2018-07-19 11:57:30', '2018-07-19 10:57:30', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">From our beginning in 1887, as a packager of generic home remedies, Perrigo has transformed itself into the world’s largest manufacturer of OTC products and suppli-er of infant formulas for the store brand market. </span></h2>\r\n<div class=\"aspect-ratio\"><iframe src=\"//www.youtube.com/embed/YHxP1AOW028\" width=\"450\" height=\"253\" frameborder=\"0\"></iframe></div>\r\n&nbsp;', 'Our Story', '', 'publish', 'closed', 'closed', '', 'our-story', '', '', '2018-08-29 18:08:11', '2018-08-29 17:08:11', '', 8, 'http://perrigo.honeydigital.co.uk/?page_id=10', 0, 'page', '', 0),
