(14, 1, '2018-07-19 11:57:46', '2018-07-19 10:57:46', '<p class=\"copy-l\" style=\"text-align: center; margin-bottom: 0;\"><span style=\"color: #283371;\"><strong>Perrigo\'s core values of integrity, respect, and responsibility guide how em-ployees should interact with each other as we conduct Perrigo business.</strong></span></p>', 'Our Vision & Values', '', 'publish', 'closed', 'closed', '', 'our-vision-values', '', '', '2018-08-29 18:11:32', '2018-08-29 17:11:32', '', 8, 'http://perrigo.honeydigital.co.uk/?page_id=14', 0, 'page', '', 0),
