(16, 1, '2018-07-19 11:57:59', '2018-07-19 10:57:59', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Following its acquisition by Perrigo in August 2014, Warman-Freed has become the UK’s first ‘learning pharmacy’, seeking to provide insights and intelligence into the day-to-day running of a typical pharmacy operation.</span></h2>\r\n<p class=\"p2\">The Learning Pharmacy allows us to gather and share real world learning. It presents a unique opportunity to learn about pharmacy from within; we can learn from real patients, behaviours and situations and then share this learning back with our pharmacy colleagues across the UK and Ireland.</p>\r\nAdding a fully-functioning retail pharmacy to our business, is part of our commitment to Pharmacy and empowering pharmacists to be strong pillars of the community. We look to provide them with the support and products to grow their business and make greater efficiencies for the NHS. Our aim is to help Pharmacy thrive, leveraging the collective expertise at Perrigo and in partnership with pharmacies across the UK.\r\n\r\nWarman-Freed is located in Golders Green, North London and is open 8.30am – Midnight every day of the year.\r\n\r\n<img class=\"size-full wp-image-472 aligncenter\" src=\"http://perrigo.honeydigital.co.uk/wp-content/uploads/2018/08/Warman_Freed_433.jpg\" alt=\"Warman_Freed\" width=\"1280\" height=\"888\" />', 'The Learning Pharmacy', '', 'publish', 'closed', 'closed', '', 'the-learning-pharmacy', '', '', '2018-08-31 10:20:25', '2018-08-31 09:20:25', '', 8, 'http://perrigo.honeydigital.co.uk/?page_id=16', 0, 'page', '', 0),
(17, 1, '2018-07-19 11:57:59', '2018-07-19 10:57:59', '', 'Warman-Freed', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-07-19 11:57:59', '2018-07-19 10:57:59', '', 16, 'http://perrigo.honeydigital.co.uk/2018/07/19/16-revision-v1/', 0, 'revision', '', 0),
(18, 1, '2018-07-19 11:58:07', '2018-07-19 10:58:07', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimising our impact on the environment. </span></h2>\r\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organisations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\r\n\r\nIn the UK, there are four different ways we support our communities\r\n<ol class=\"features-list\">\r\n 	<li>\r\n<h4>Site charity of the year</h4>\r\nOur employees across each of our sites vote to support a local cause that means a lot to them.</li>\r\n 	<li>\r\n<h4>Supporting a UK-wide initiative</h4>\r\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.</li>\r\n 	<li>\r\n<h4>Matching charity activities</h4>\r\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.</li>\r\n 	<li>\r\n<h4>Volunteer programme</h4>\r\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.</li>\r\n</ol>', 'Corporate Social Responsibility', '', 'publish', 'closed', 'closed', '', 'csr', '', '', '2018-08-30 11:49:07', '2018-08-30 10:49:07', '', 8, 'http://perrigo.honeydigital.co.uk/?page_id=18', 0, 'page', '', 0),
(19, 1, '2018-07-19 11:58:07', '2018-07-19 10:58:07', '', 'CSR', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-07-19 11:58:07', '2018-07-19 10:58:07', '', 18, 'http://perrigo.honeydigital.co.uk/2018/07/19/18-revision-v1/', 0, 'revision', '', 0),
(20, 1, '2018-07-19 11:58:46', '2018-07-19 10:58:46', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">At Perrigo, our pursuit of quality is not limited to the operational level, but is valued at every level of our business.</span></h2>\r\nOur Quality Management System, which is based on current industry and regulatory concepts for a modern quality management system, ensures that quality is fully integrated into our global business processes.\r\n\r\nWhy do we have this focus on quality? The answer is simple: we want to ensure that every Perrigo product, no matter where in the world it is produced, meets the high expectations for safety and effectiveness held by our customers, consumers, employees, regulatory agencies and shareowners.\r\n\r\nWe will continue to focus on quality as we expand our business across the globe. Our stakeholders and customers expect this from us; we expect this from ourselves; and our ability to produce \"Quality Affordable Healthcare Products™\" for consumers around the world depends on it.\r\n<h4>Conducting Ourselves with Integrity</h4>\r\n<a href=\"http://perrigo.investorroom.com/download/Code+of+Conduct.pdf\">We Are Responsible: Our Code of Conduct</a> helps all of us at Perrigo act with integrity and safeguard our company\'s reputation. It contains the global standards we must follow to ensure we uphold our core values, and it provides principles to guide our conduct and help us do what is right. The code applies to all employees, officers and directors, as well as those working on Perrigo\'s behalf, such as consultants, agents and business partners.\r\n\r\nWe also expect our suppliers to adhere to our high quality and ethical standards. That is why we have a Supplier Code of Conduct to guide their actions.', 'Our Commitment  to Quality', '', 'publish', 'closed', 'closed', '', 'our-commitment-to-quality', '', '', '2018-08-29 18:15:07', '2018-08-29 17:15:07', '', 8, 'http://perrigo.honeydigital.co.uk/?page_id=20', 0, 'page', '', 0),
