(25, 1, '2018-07-19 12:00:00', '2018-07-19 11:00:00', '<img class=\"alignnone wp-image-259\" src=\"http://perrigo.honeydigital.co.uk/wp-content/uploads/2018/08/galpharm.png\" alt=\"galpharm\" width=\"209\" height=\"91\" />\r\n<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the UK &amp; Ireland’s largest supplier of Private Label OTC medicines with manufacturing facilities located in Braunton and Barnsley.</span></h2>\r\n<p class=\"p2\">Our cGMP, GDP and MHRA approved facilities offer contract manufacturing of a wide range of formulation &amp; packing technologies for leading international branded pharmaceutical companies as well as formulations under our own brand – Galpharm.</p>\r\n<p class=\"p2\">Our portfolio – which comprises of 223 product licenses, 121 of which are valid in the UK – is available in a variety of formats including sachet, tablet, cream, liquid, ointment, capsule and lozenges, addressing all major therapeutic needs including analgesics, cough &amp; cold, NRT and female health.</p>\r\n<p class=\"p2\">Our highest priority is the quality of our products and we continually invest in our facilities and review our capabilities to enable us to offer an ever growing range of OTC medicines.</p>\r\n<p class=\"p2\">We operate 24 hours a day, 5 days a week from our manufacturing site in Braunton before products are sent to our warehousing facility in Barnsley for distribution.</p>', 'Galpharm', '', 'publish', 'closed', 'closed', '', 'galpharm', '', '', '2018-08-29 18:14:08', '2018-08-29 17:14:08', '', 0, 'http://perrigo.honeydigital.co.uk/?page_id=25', 0, 'page', '', 0),
(26, 1, '2018-07-19 12:00:00', '2018-07-19 11:00:00', '', 'Galpharm', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2018-07-19 12:00:00', '2018-07-19 11:00:00', '', 25, 'http://perrigo.honeydigital.co.uk/2018/07/19/25-revision-v1/', 0, 'revision', '', 0),
(27, 1, '2018-07-19 12:00:25', '2018-07-19 11:00:25', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">The team at Perrigo has a wealth of experience in quoting for, winning and implementing significant Contract Manufacturing opportunities.</span></h2>\r\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>', 'Contract Manufacturing', '', 'publish', 'closed', 'closed', '', 'contract-manufacturing', '', '', '2018-09-06 15:51:46', '2018-09-06 14:51:46', '', 23, 'http://perrigo.honeydigital.co.uk/?page_id=27', 0, 'page', '', 0),
