(35, 1, '2018-07-19 12:01:31', '2018-07-19 11:01:31', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the fastest growing and a top 5 consumer healthcare company in the UK &amp; Ireland.</span></h2>\r\nThe Branded Consumer Healthcare areas of Perrigo UK &amp; Ireland specialises in delivering innovative over-the-counter (OTC) treatments that can be purchased without a prescription. We are committed to making a difference to health, by helping people lead healthier lives and positively affecting their wellbeing. Our product portfolio includes iconic brands such as Solpadeine, Nytol, TCP, Jungle Formula, complemented by breakthrough innovations for weight loss (XLS-Medical &amp; XLS-Nutrition) and skin health (Dermalex).', 'Our Brands', '', 'publish', 'closed', 'closed', '', 'our-brands', '', '', '2018-08-31 10:16:05', '2018-08-31 09:16:05', '', 23, 'http://perrigo.honeydigital.co.uk/?page_id=35', 0, 'page', '', 0),
