(41, 1, '2018-07-19 12:02:40', '2018-07-19 11:02:40', '<h2 class=\"h4\" style=\"font-weight: normal;\"><span style=\"color: #283371;\">We live by <a style=\"color: #283371;\" href=\"http://perrigo.honeydigital.co.uk/about-us/our-vision-values/\">our values</a> of <strong>Respect</strong>: we demonstrate the value we hold for one another, <strong>Integrity</strong>: we do what is right and <strong>Responsibility</strong>: we hold ourselves accountable for our actions.</span></h2>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>\r\n\r\n<ul class=\"flair\">\r\n 	<li>\r\n<h4>We are different</h4>\r\nWhile every business thinks it’s different, Perrigo UK truly is uniquely positioned within healthcare; operating across branded, store brand and pharmaceutical environments, all supported by our world-class quality manufacturing and distribution. Not to mention our real-world learning pharmacy where we can access incredible insights around customer experience and buying behaviour.\r\nThis means you’ll get the opportunity to grow across a breadth of areas, watch your work come to life and learn something new every day.</li>\r\n 	<li>\r\n<h4>We make a difference</h4>\r\nAt Perrigo, we are passionate about making a difference to health - relentlessly pursuing better healthcare outcomes and improved quality of life. We do this by making quality healthcare accessible and affordable for people around the world.\r\n\r\nBut this mission goes beyond our customers, we also want to make a difference to the lives of our people at Perrigo and to the communities we operate in. This is why we run an employee wellness programme and give to employee nominated causes through our <a href=\"https://www.perrigo.com/about/perrigo-foundation.aspx\" target=\"_blank\" rel=\"noopener\">Perrigo Company Charitable Foundation</a>.</li>\r\n</ul>\r\n\r\n<hr />\r\n\r\n<h4>Our locations</h4>\r\nWe are lucky enough to have approximately 10,000 colleagues doing amazing things in over 30 countries, spread across the globe. This includes the UK and Ireland, but also America, Australia, India, Israel, plus much of Europe.\r\n\r\nThis means a world of job opportunities will be open to you. We encourage internal recruitment and are proud of our commitment to supporting the mobility of our people.\r\n\r\n<strong>In the UK</strong>\r\nWe have 5 sites in the UK across Leeds, Barnsley, Braunton and two in London with our Global Headquarters based in Ireland.\r\n<h4>Our roles</h4>\r\nColleagues undertake a range of roles from marketing to regulatory and scientific affairs, to manufacturing, engineering and quality, to finance and design. Plus more!\r\n\r\n<span style=\"color: #283371;\"><strong>Sound interesting? Take a look at our current vacancies to see if we have a job for you.</strong></span>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>', 'Careers', '', 'publish', 'closed', 'closed', '', 'careers', '', '', '2018-09-06 13:59:39', '2018-09-06 12:59:39', '', 0, 'http://perrigo.honeydigital.co.uk/?page_id=41', 0, 'page', '', 0),
