(109, 1, '2018-08-20 12:37:43', '2018-08-20 11:37:43', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">Perrigo is one of the fastest growing healthcare companies in the world, and an in-dustry leader in pharmaceutical technologies. We develop, manufacture and dis-tribute over-the-counter (OTC) branded and non-branded consumer goods, as well as prescription (Rx) pharmaceuticals. </span></h2>\nYou may have heard of some of our iconic household brands including Nytol, Solpadeine, Tiger Balm, NiQuitin, Jungle Formula, Dermalex, XLS-Medical and family favourite TCP. We also produce over 160 liquid medicines helping to treat a variety of conditions, such as musculoskeletal and joint diseases, cardiovascular disease, infections, swallowing problems and more.\n<h3><span style=\"color: #283371;\">Our Global Presence</span></h3>\nPerrigo Company plc, through its direct and indirect subsidiaries, operates at the following locations:', 'About Us', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2018-08-20 12:37:43', '2018-08-20 11:37:43', '', 8, 'http://perrigo.honeydigital.co.uk/8-autosave-v1/', 0, 'revision', '', 0),
(110, 1, '2018-07-23 09:22:35', '2018-07-23 08:22:35', '<p class=\"copy-l\">Perrigo Company plc is a leading global healthcare company that develops, manufactures and distributes over-the-counter (OTC) consumer goods, prescription (Rx) pharmaceuticals, nutritional products, and active pharmaceutical ingredients (API). The company is the world\'s largest manufacturer of OTC pharmaceutical products for the Private Label market and an industry leader in pharmaceutical technologies.</p>\r\nFrom its beginnings in 1887 as a packager of generic home remedies, Perrigo, headquartered in Ireland, has grown to become the world\'s largest manufacturer of OTC pharmaceutical products for the Private Label market and an industry leader in pharmaceutical technologies. Perrigo provides \"Quality Affordable Healthcare Products®\" across a wide variety of product categories and geographies primarily in North America, Europe, and Australia, as well as other key markets including Israel and China.\r\n<h3>Our Global Presence</h3>\r\nPerrigo Company plc, through its direct and indirect subsidiaries, operates at the following locations:', 'About Us', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2018-07-23 09:22:35', '2018-07-23 08:22:35', '', 8, 'http://perrigo.honeydigital.co.uk/8-revision-v1/', 0, 'revision', '', 0),
