(139, 1, '2018-08-24 15:26:01', '2018-08-24 14:26:01', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">The team at Perrigo has a wealth of experience in quoting for, winning and implementing significant Contract Manufacturing opportunities.</span></h2>\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>', 'Multi-format Pharmaceutical  Contract Manufacturing & Packing', '', 'inherit', 'closed', 'closed', '', '27-autosave-v1', '', '', '2018-08-24 15:26:01', '2018-08-24 14:26:01', '', 27, 'http://perrigo.honeydigital.co.uk/27-autosave-v1/', 0, 'revision', '', 0),
(140, 1, '2018-07-23 16:27:39', '2018-07-23 15:27:39', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">The team at Perrigo has a wealth of experience in quoting for, winning and implementing significant Contract Manufacturing opportunities.</span></p>\r\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>\r\n\r\n<h3><span style=\"color: #283371;\">Our Services</span></h3>\r\n<p class=\"p1\">We supply and manufacture a broad range of OTC and healthcare products. Our highly trained staff provide expertise and support in the following areas:</p>\r\n\r\n<ul>\r\n 	<li class=\"p1\">New product development</li>\r\n 	<li class=\"p1\">Validation</li>\r\n 	<li class=\"p1\">Process support</li>\r\n 	<li class=\"p1\">Packaging solutions</li>\r\n 	<li class=\"p1\">Artwork and origination</li>\r\n 	<li class=\"p1\">Promotion and advertising assistance</li>\r\n 	<li class=\"p1\">Licence applications</li>\r\n 	<li class=\"p1\">UK Regulatory legislation</li>\r\n 	<li class=\"p1\">Warehousing</li>\r\n</ul>', 'Contract  Manufacturing', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2018-07-23 16:27:39', '2018-07-23 15:27:39', '', 27, 'http://perrigo.honeydigital.co.uk/27-revision-v1/', 0, 'revision', '', 0),
(143, 1, '2018-08-08 11:17:03', '2018-08-08 10:17:03', '<h2 style=\"text-align: center;\"><span style=\"color: #00a5db;\">Quality Affordable Healthcare Products</span></h2>\r\n<h3 style=\"text-align: center; font-weight: normal;\">Whatever your healthcare needs, we’re here to help.</h3>\r\n<p class=\"narrow-para\" style=\"text-align: center;\">Rumqui te solorem nonesti untio eumquas asperuptate doloris quosa et audita vent landipient re net utempos re premolo rposti nimus ipsum qui volorepro doluptaqui distium, quatur res ulluptur magnis alitate alitecto.</p>', 'Perrigo', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-08-08 11:17:03', '2018-08-08 10:17:03', '', 2, 'http://perrigo.honeydigital.co.uk/2-revision-v1/', 0, 'revision', '', 0),
(144, 1, '2018-08-24 17:04:20', '2018-08-24 16:04:20', '<h2 class=\"h4\" style=\"font-weight: normal;\"><span style=\"color: #283371;\">We live by <a style=\"color: #283371;\" href=\"http://perrigo.honeydigital.co.uk/about-us/our-vision-values/\">our values</a> of <strong>Respect</strong>: we demonstrate the value we hold for one another, <strong>Integrity</strong>: we do what is right and <strong>Responsibility</strong>: we hold ourselves accountable for our actions.</span></h2>\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>\n\n<div class=\"aspect-ratio\"><iframe src=\"https://www.youtube.com/embed/eWy3QqiLYEY?rel=0\" width=\"1280\" height=\"720\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"><span data-mce-type=\"bookmark\" style=\"display: inline-block; width: 0px; overflow: hidden; line-height: 0;\" class=\"mce_SELRES_start\">﻿</span></iframe></div>\n&nbsp;\n<ul class=\"flair\">\n 	<li>\n<h4>We are different</h4>\nWhile every business thinks it’s different, Perrigo UK truly is uniquely positioned within healthcare; operating across branded, store brand and pharmaceutical environments, all supported by our world-class quality manufacturing and distribution. Not to mention our real-world learning pharmacy where we can access incredible insights around customer experience and buying behaviour.\nThis means you’ll get the opportunity to grow across a breadth of areas, watch your work come to life and learn something new every day.</li>\n 	<li>\n<h4>We make a difference</h4>\nAt Perrigo, we are passionate about making a difference to health - relentlessly pursuing better healthcare outcomes and improved quality of life. We do this by making quality healthcare accessible and affordable for people around the world.\n\nBut this mission goes beyond our customers, we also want to make a difference to the lives of our people at Perrigo and to the communities we operate in. This is why we run an employee wellness programme and give to employee nominated causes through our <a href=\"https://www.perrigo.com/about/perrigo-foundation.aspx\" target=\"_blank\" rel=\"noopener\">Perrigo Company Charitable Foundation</a>.</li>\n</ul>', 'Careers', '', 'inherit', 'closed', 'closed', '', '41-autosave-v1', '', '', '2018-08-24 17:04:20', '2018-08-24 16:04:20', '', 41, 'http://perrigo.honeydigital.co.uk/41-autosave-v1/', 0, 'revision', '', 0),
