(162, 1, '2018-08-08 12:12:34', '2018-08-08 11:12:34', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">We are the UK &amp; Ireland’s largest supplier of Private Label OTC medicines with manufacturing facilities located in Braunton and Barnsley.</span></p>\r\n<p class=\"p2\">Our cGMP, GDP and MHRA approved facilities offer contract manufacturing of a wide range of formulation &amp; packing technologies for leading international branded pharmaceutical companies as well as formulations under our own brand – Galpharm.</p>\r\n<p class=\"p2\">Our portfolio – which comprises of 223 product licenses, 121 of which are valid in the UK – is available in a variety of formats including sachet, tablet, cream, liquid, ointment, capsule and lozenges, addressing all major therapeutic needs including analgesics, cough &amp; cold, NRT and female health.</p>\r\n<p class=\"p2\">Our highest priority is the quality of our products and we continually invest in our facilities and review our capabilities to enable us to offer an ever growing range of OTC medicines.</p>\r\n<p class=\"p2\">We operate 24 hours a day, 5 days a week from our manufacturing site in Braunton before products are sent to our warehousing facility in Barnsley for distribution.</p>', 'Galpharm', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2018-08-08 12:12:34', '2018-08-08 11:12:34', '', 25, 'http://perrigo.honeydigital.co.uk/25-revision-v1/', 0, 'revision', '', 0),
