(174, 1, '2018-08-15 15:21:58', '2018-08-15 14:21:58', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">The team at Perrigo has a wealth of experience in quoting for, winning and implementing significant Contract Manufacturing opportunities.</span></p>\r\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>', 'Our Story', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-08-15 15:21:58', '2018-08-15 14:21:58', '', 10, 'http://perrigo.honeydigital.co.uk/10-revision-v1/', 0, 'revision', '', 0),
(175, 1, '2018-08-15 15:23:07', '2018-08-15 14:23:07', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Every second of every day, somewhere in the world, nearly 1,750 people use a Perrigo product.</span></p>\r\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>', 'Our Story', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-08-15 15:23:07', '2018-08-15 14:23:07', '', 10, 'http://perrigo.honeydigital.co.uk/10-revision-v1/', 0, 'revision', '', 0),
(176, 1, '2018-08-15 15:26:10', '2018-08-15 14:26:10', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">From its beginning in 1887, as a packager of generic home remedies, Perrigo, headquartered in Ireland, has grown to become the world’s largest manufacturer of OTC products and supplier of infant formulas for the store brand market.</span></p>\n<p class=\"p2\">The Company is also a leading provider of branded OTC products, generic extended topical prescription products and receives royalties from Multiple Sclerosis drug Tysabri. Perrigo provides ‘Quality Affordable Healthcare Products’ across a wide variety of product categories and geographies primarily in North America, Europe, and Australia, as well as other key markets including Israel and China.</p>\n<div class=\"aspec<iframe src=\"//www.youtube.com/embed/YHxP1AOW028\" width=\"450\" height=\"253\" frameborder=\"0\"></iframe>', 'Our Story', '', 'inherit', 'closed', 'closed', '', '10-autosave-v1', '', '', '2018-08-15 15:26:10', '2018-08-15 14:26:10', '', 10, 'http://perrigo.honeydigital.co.uk/10-autosave-v1/', 0, 'revision', '', 0),
