(196, 1, '2018-08-15 16:16:57', '2018-08-15 15:16:57', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Since August 2014, we own and manage Warman-Freed, a community pharmacy in North London, as a learning pharmacy.</span></p>\r\n<p class=\"p2\">The focus of the learning pharmacy operation is on establishing insights and intelligence that can improve the day-to-day running of a typical community pharmacy operation. Learnings are used to shape changes across the store and shared with interested professionals throughout the industry.</p>', 'Warman-Freed Learning Pharmacy', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-08-15 16:16:57', '2018-08-15 15:16:57', '', 16, 'http://perrigo.honeydigital.co.uk/16-revision-v1/', 0, 'revision', '', 0),
(197, 1, '2018-08-15 16:18:01', '2018-08-15 15:18:01', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Since August 2014, we own and manage Warman-Freed, a community pharmacy in North London, as a learning pharmacy.</span></p>\r\n<p class=\"p2\">The focus of the learning pharmacy operation is on establishing insights and intelligence that can improve the day-to-day running of a typical community pharmacy operation. Learnings are used to shape changes across the store and shared with interested professionals throughout the industry.</p>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-15 16:18:01', '2018-08-15 15:18:01', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
(198, 1, '2018-08-24 12:36:41', '2018-08-24 11:36:41', '<h2 class=\"h3\"><span style=\"color: #283371;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimizing our impact on the environment. </span></h2>\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\n\n<h3>The Perrigo Foundation</h3>\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organizations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\n\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\n\nIn the UK, there are four different ways we support our communities\n<ul class=\"features-list\">\n 	<li><h4>Site charity of the year</h4>\nOur employees across each of our sites vote to support a local cause that means a lot to them.</li>\n 	<li><h4>Supporting a UK-wide initiative</h4>\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.</li>\n 	<li><h4>Matching charity activities</h4>\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.</li>\n 	<li><strong>4 Volunteer programme</strong>\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.</li>\n</ul>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-autosave-v1', '', '', '2018-08-24 12:36:41', '2018-08-24 11:36:41', '', 18, 'http://perrigo.honeydigital.co.uk/18-autosave-v1/', 0, 'revision', '', 0),
(199, 1, '2018-08-15 16:20:10', '2018-08-15 15:20:10', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognizing our efforts to ensure that how we achieve results is just as impactful as the results themselves.</span></p>\r\n<p class=\"p2\">We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognize the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n<strong>Helping consumers access safe, effective and affordable healthcare products.</strong>\r\n\r\nAnnually, Perrigo saves its consumers approximately $7.5 billion worldwide, by providing high quality comparable medicines, nutritional supplements, infant formula, animal health products and medical devices that are affordable, often 30%–50% less than the national brands to which they compare.\r\n\r\nRegardless of the type of product or location across the globe, Perrigo remains committed to driving down the cost of healthcare and improving accessibility to medicines, while ensuring the safety and quality of our products meets or exceeds all requirements from the Food and Drug Administration (FDA), Medicine and Healthcare Products Regulatory Agency (MHRA) and the many other governing bodies of the countries in which Perrigo operates.\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organization wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organizations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nIn the UK, we have recently supported the following:\r\n<ul>\r\n 	<li>Alcohol Education Trust</li>\r\n 	<li>Barnsley Hospice</li>\r\n 	<li>Barnsley Hospital Charity</li>\r\n 	<li>Barnsley Independent Alzheimers and Dementia Support</li>\r\n 	<li>Barnsley Special Baby Care Unit</li>\r\n 	<li>Bluebell Wood Children\'s Hospice</li>\r\n 	<li>Braunton Academy</li>\r\n 	<li>Braunton Volunteers</li>\r\n 	<li>Braunton</li>\r\n 	<li>British Heart Foundation</li>\r\n 	<li>Calvert Trust Exmoor</li>\r\n 	<li>Cancer Research UK</li>\r\n 	<li>Candlelighters</li>\r\n 	<li>Children\'s Hospital</li>\r\n 	<li>Darton Community College</li>\r\n 	<li>Devon Air Ambulance</li>\r\n 	<li>Devon Diving Research Centre</li>\r\n 	<li>Devon Freewheelers</li>\r\n 	<li>Early Bird Autism</li>\r\n 	<li>Exeter Community Initiative (Ripple Effect Braunton)</li>\r\n 	<li>Macmillan</li>\r\n 	<li>Meanwood Valley Urban Farm</li>\r\n 	<li>NDADA</li>\r\n 	<li>North Devon Hospice</li>\r\n 	<li>Pathfields Activity Centre</li>\r\n 	<li>Pippa Jones Little Treasure Trust</li>\r\n 	<li>RNLI</li>\r\n 	<li>Station House (SHCA)</li>\r\n 	<li>Yorkshire Air Ambulance</li>\r\n</ul>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-15 16:20:10', '2018-08-15 15:20:10', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
