(210, 1, '2018-08-15 16:34:33', '2018-08-15 15:34:33', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">Perrigo Company plc is a leading global healthcare company that develops, manufactures and distributes over-the-counter (OTC) consumer goods, prescription (Rx) pharmaceuticals, nutritional products, and active pharmaceutical ingredients (API). The company is the world\'s largest manufacturer of OTC pharmaceutical products for the Private Label market and an industry leader in pharmaceutical technologies.</span></h2>\r\nFrom its beginnings in 1887 as a packager of generic home remedies, Perrigo, headquartered in Ireland, has grown to become the world\'s largest manufacturer of OTC pharmaceutical products for the Private Label market and an industry leader in pharmaceutical technologies. Perrigo provides \"Quality Affordable Healthcare Products®\" across a wide variety of product categories and geographies primarily in North America, Europe, and Australia, as well as other key markets including Israel and China.\r\n<h3><span style=\"color: #283371;\">Our Global Presence</span></h3>\r\nPerrigo Company plc, through its direct and indirect subsidiaries, operates at the following locations:', 'About Us', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2018-08-15 16:34:33', '2018-08-15 15:34:33', '', 8, 'http://perrigo.honeydigital.co.uk/8-revision-v1/', 0, 'revision', '', 0),
(211, 1, '2018-08-15 16:34:51', '2018-08-15 15:34:51', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">Since August 2014, we own and manage Warman-Freed, a community pharmacy in North London, as a learning pharmacy.</span></h2>\r\n<p class=\"p2\">The focus of the learning pharmacy operation is on establishing insights and intelligence that can improve the day-to-day running of a typical community pharmacy operation. Learnings are used to shape changes across the store and shared with interested professionals throughout the industry.</p>', 'Warman-Freed Learning Pharmacy', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-08-15 16:34:51', '2018-08-15 15:34:51', '', 16, 'http://perrigo.honeydigital.co.uk/16-revision-v1/', 0, 'revision', '', 0),
(212, 1, '2018-08-15 16:35:16', '2018-08-15 15:35:16', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">From its beginning in 1887, as a packager of generic home remedies, Perrigo, headquartered in Ireland, has grown to become the world’s largest manufacturer of OTC products and supplier of infant formulas for the store brand market.</span></h2>\r\n<p class=\"p2\">The Company is also a leading provider of branded OTC products, generic extended topical prescription products and receives royalties from Multiple Sclerosis drug Tysabri. Perrigo provides ‘Quality Affordable Healthcare Products’ across a wide variety of product categories and geographies primarily in North America, Europe, and Australia, as well as other key markets including Israel and China.</p>\r\n\r\n<div class=\"aspect-ratio\"><iframe src=\"//www.youtube.com/embed/YHxP1AOW028\" width=\"450\" height=\"253\" frameborder=\"0\"></iframe></div>', 'Our Story', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-08-15 16:35:16', '2018-08-15 15:35:16', '', 10, 'http://perrigo.honeydigital.co.uk/10-revision-v1/', 0, 'revision', '', 0);
