(213, 1, '2018-08-15 16:35:56', '2018-08-15 15:35:56', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">The team at Perrigo has a wealth of experience in quoting for, winning and implementing significant Contract Manufacturing opportunities.</span></h2>\r\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>\r\n\r\n<h3><span style=\"color: #283371;\">Our Services</span></h3>\r\n<p class=\"p1\">We supply and manufacture a broad range of OTC and healthcare products. Our highly trained staff provide expertise and support in the following areas:</p>\r\n\r\n<ul>\r\n 	<li class=\"p1\">New product development</li>\r\n 	<li class=\"p1\">Validation</li>\r\n 	<li class=\"p1\">Process support</li>\r\n 	<li class=\"p1\">Packaging solutions</li>\r\n 	<li class=\"p1\">Artwork and origination</li>\r\n 	<li class=\"p1\">Promotion and advertising assistance</li>\r\n 	<li class=\"p1\">Licence applications</li>\r\n 	<li class=\"p1\">UK Regulatory legislation</li>\r\n 	<li class=\"p1\">Warehousing</li>\r\n</ul>', 'Contract  Manufacturing', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2018-08-15 16:35:56', '2018-08-15 15:35:56', '', 27, 'http://perrigo.honeydigital.co.uk/27-revision-v1/', 0, 'revision', '', 0),
(214, 1, '2018-08-15 16:36:27', '2018-08-15 15:36:27', '<h2 class=\"p copy-l\" style=\"text-align: center;\"><span style=\"color: #00a5db;\">Perrigo is one of the fastest-growing companies in the healthcare industry.\r\nOur success has accelerated our need for qualified people who can help us set the benchmarks for pharmaceutical operations, quality, packaging and other areas.\r\nWe need the best to be the best.</span></h2>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>\r\n\r\n<div class=\"aspect-ratio\"><iframe src=\"https://www.youtube.com/embed/eWy3QqiLYEY?rel=0\" width=\"1280\" height=\"720\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"><span data-mce-type=\"bookmark\" style=\"display: inline-block; width: 0px; overflow: hidden; line-height: 0;\" class=\"mce_SELRES_start\">﻿</span></iframe></div>', 'Careers', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2018-08-15 16:36:27', '2018-08-15 15:36:27', '', 41, 'http://perrigo.honeydigital.co.uk/41-revision-v1/', 0, 'revision', '', 0),
(215, 1, '2018-08-15 16:36:35', '2018-08-15 15:36:35', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">We are the UK &amp; Ireland’s largest supplier of Private Label OTC medicines with manufacturing facilities located in Braunton and Barnsley.</span></h2>\r\n<p class=\"p2\">Our cGMP, GDP and MHRA approved facilities offer contract manufacturing of a wide range of formulation &amp; packing technologies for leading international branded pharmaceutical companies as well as formulations under our own brand – Galpharm.</p>\r\n<p class=\"p2\">Our portfolio – which comprises of 223 product licenses, 121 of which are valid in the UK – is available in a variety of formats including sachet, tablet, cream, liquid, ointment, capsule and lozenges, addressing all major therapeutic needs including analgesics, cough &amp; cold, NRT and female health.</p>\r\n<p class=\"p2\">Our highest priority is the quality of our products and we continually invest in our facilities and review our capabilities to enable us to offer an ever growing range of OTC medicines.</p>\r\n<p class=\"p2\">We operate 24 hours a day, 5 days a week from our manufacturing site in Braunton before products are sent to our warehousing facility in Barnsley for distribution.</p>', 'Galpharm', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2018-08-15 16:36:35', '2018-08-15 15:36:35', '', 25, 'http://perrigo.honeydigital.co.uk/25-revision-v1/', 0, 'revision', '', 0),
