(232, 1, '2018-08-16 12:28:28', '2018-08-16 11:28:28', '<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Respect: We demonstrate the value we hold for one another</span></p>\r\n\r\n<ul>\r\n 	<li>We act with respect towards our colleagues and others with whom we interact.</li>\r\n 	<li>We communicate openly and candidly and address our differences professionally.</li>\r\n 	<li>We emphasise teamwork, value each person\'s contribution, and collaborate in confidence and trust.</li>\r\n</ul>\r\n<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Integrity: We do what is right.</span></p>\r\n\r\n<ul>\r\n 	<li>We are committed to conducting our business with individual and organisational integrity.</li>\r\n 	<li>We comply with the law and avoid conflicts of interest.</li>\r\n 	<li>We are reliable, honest and trustworthy in our dealings.</li>\r\n</ul>\r\n<p class=\"p1 copy-l\"><span style=\"color: #00a5db;\">Responsibility: We hold ourselves accountable for our actions.</span></p>\r\n\r\n<ul>\r\n 	<li>We accept personal responsibility for everything that we do and we lead by example.</li>\r\n 	<li>We treat the Company\'s reputation as our own and try to make wise use of our time and the Company\'s resources.</li>\r\n 	<li>We take responsibility for performing at our best and strive to achieve our own and the Company\'s potential.</li>\r\n 	<li>We are committed to a culture of shared responsibility that promotes a safe, healthy and high performing workforce.</li>\r\n</ul>\r\nPerrigo\'s core values of integrity, respect, and responsibility guide how employees should interact with each other as we conduct Perrigo business. In addition to these, in the UK &amp; Ireland, we have a set of attributes that encapsulate how we want to do business. We use the following four behaviours to challenge ourselves and each other daily – these are part of our culture.\r\n\r\n&nbsp;\r\n\r\n<strong>We lead with honesty</strong>\r\n<ul>\r\n 	<li>We collaborate</li>\r\n 	<li>We are honest, open and true to ourselves</li>\r\n 	<li>We command respect from those we work with</li>\r\n</ul>\r\n<strong>We are proud to care</strong>\r\n<ul>\r\n 	<li>We are principled in our actions and uncompromising in our delivery</li>\r\n 	<li>What we do is meaningful and we care about what we do</li>\r\n</ul>\r\n<strong>We think smart</strong>\r\n<ul>\r\n 	<li>We are savvy and our approaches are agile</li>\r\n 	<li>We seek the extraordinary and relentlessly focus on what makes a difference</li>\r\n</ul>\r\n<strong>We aim for the top</strong>\r\n<ul>\r\n 	<li>We are imaginative</li>\r\n 	<li>We rise to a challenge and strive to be the best we can be</li>\r\n</ul>', 'Our Vision & Values', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2018-08-16 12:28:28', '2018-08-16 11:28:28', '', 14, 'http://perrigo.honeydigital.co.uk/14-revision-v1/', 0, 'revision', '', 0),
