(308, 1, '2018-08-20 12:49:11', '2018-08-20 11:49:11', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">Perrigo is one of the fastest growing healthcare companies in the world, and an in-dustry leader in pharmaceutical technologies. We develop, manufacture and dis-tribute over-the-counter (OTC) branded and non-branded consumer goods, as well as prescription (Rx) pharmaceuticals.</span></h2>\r\nYou may have heard of some of our iconic household brands including Nytol, Solpadeine, Tiger Balm, NiQuitin, Jungle Formula, Dermalex, XLS-Medical and family favourite TCP. We also produce over 160 liquid medicines helping to treat a variety of conditions, such as musculoskeletal and joint diseases, cardiovascular disease, infections, swallowing problems and more.\r\n\r\nAt Perrigo, we are unapologetically passionate about making a difference to health - relentlessly making quality healthcare products accessible and affordable for people around the world.', 'About Us', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2018-08-20 12:49:11', '2018-08-20 11:49:11', '', 8, 'http://perrigo.honeydigital.co.uk/8-revision-v1/', 0, 'revision', '', 0),
(309, 1, '2018-08-20 13:02:28', '2018-08-20 12:02:28', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">From our beginning in 1887, as a packager of generic home remedies, Perrigo has transformed itself into the world’s largest manufacturer of OTC products and suppli-er of infant formulas for the store brand market. </span></h2>\r\n<div class=\"aspect-ratio\"><iframe src=\"//www.youtube.com/embed/YHxP1AOW028\" width=\"450\" height=\"253\" frameborder=\"0\"></iframe></div>', 'Our Story', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-08-20 13:02:28', '2018-08-20 12:02:28', '', 10, 'http://perrigo.honeydigital.co.uk/10-revision-v1/', 0, 'revision', '', 0),
(310, 1, '2018-08-20 13:04:10', '2018-08-20 12:04:10', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimizing our impact on the environment. </span></h2>\r\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organizations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\r\n\r\nIn the UK, there are four different ways we support our communities\r\n<ul>\r\n 	<li>\r\n<ol>\r\n 	<li><strong> Site charity of the year</strong></li>\r\n</ol>\r\nOur employees across each of our sites vote to support a local cause that means a lot to them.\r\n<ol start=\"2\">\r\n 	<li><strong> Supporting a UK-wide initiative</strong></li>\r\n</ol>\r\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.<strong>\r\n</strong>\r\n<ol start=\"3\">\r\n 	<li><strong> Matching charity activities</strong></li>\r\n</ol>\r\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.\r\n<ol start=\"4\">\r\n 	<li><strong> Volunteer Programme</strong></li>\r\n</ol>\r\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.</li>\r\n</ul>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-20 13:04:10', '2018-08-20 12:04:10', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
(311, 1, '2018-08-20 13:04:55', '2018-08-20 12:04:55', '<h2 class=\"p copy-l\"><span style=\"color: #00a5db;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimizing our impact on the environment. </span></h2>\r\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organizations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\r\n\r\nIn the UK, there are four different ways we support our communities\r\n\r\n<strong>1. Site charity of the year</strong>\r\n\r\nOur employees across each of our sites vote to support a local cause that means a lot to them.\r\n\r\n<strong>2. Supporting a UK-wide initiative</strong>\r\n\r\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.<strong>\r\n</strong>\r\n\r\n<strong>3. Matching charity activities</strong>\r\n\r\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.\r\n\r\n<strong>4. Volunteer Programme</strong>\r\n\r\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-20 13:04:55', '2018-08-20 12:04:55', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
