(316, 1, '2018-08-30 09:14:05', '2018-08-30 08:14:05', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the fastest growing and a top 5 consumer healthcare company in the UK &amp; Ireland.</span></h2>\nThe Branded Consumer Healthcare areas of Perrigo UK &amp; Ireland specialises in delivering innovative over-the-counter (OTC) treatments that can be purchased without a prescription. We are committed to making a difference to health, by helping people lead healthier lives and positively affecting their wellbeing. Our product portfolio includes iconic brands such as Solpadeine, Nytol, TCP, Jungle Formula, complemented by breakthrough innovations for weight loss (XLS-Medical &amp; XLS-Nutrition) and skin health (Dermalex).', 'Our Brands', '', 'inherit', 'closed', 'closed', '', '35-autosave-v1', '', '', '2018-08-30 09:14:05', '2018-08-30 08:14:05', '', 35, 'http://perrigo.honeydigital.co.uk/35-autosave-v1/', 0, 'revision', '', 0),
(317, 1, '2018-08-20 13:22:44', '2018-08-20 12:22:44', '<p class=\"copy-l\"><span style=\"color: #00a5db;\">We are the fastest growing and a top 5 consumer healthcare company in the UK &amp; Ireland.</span></p>\r\nThe Branded Consumer Healthcare areas of Perrigo UK &amp; Ireland specialises in delivering innovative over-the-counter (OTC) treatments that can be purchased without a prescription. We are committed to making a difference to health, by helping people lead healthier lives and positively affecting their wellbeing. Our product portfolio includes iconic brands such as Solpadeine, Nytol, TCP, Jungle Formula, complemented by breakthrough innovations for weight loss (XLS-Medical &amp; XLS-Nutrition) and skin health (Dermalex).', 'Our Brands', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2018-08-20 13:22:44', '2018-08-20 12:22:44', '', 35, 'http://perrigo.honeydigital.co.uk/35-revision-v1/', 0, 'revision', '', 0),
(319, 1, '2018-08-24 09:52:54', '2018-08-24 08:52:54', '<h2 class=\"p copy-l\" style=\"text-align: center;\"><span style=\"color: #00a5db;\">We live by <a style=\"color: #00a5db;\" href=\"http://perrigo.honeydigital.co.uk/about-us/our-vision-values/\">our values</a> of <strong>Respect</strong>: we demonstrate the value we hold for one another, <strong>Integrity</strong>: we do what is right and <strong>Responsibility</strong>: we hold ourselves accountable for our actions.</span></h2>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>\r\n\r\n<div class=\"aspect-ratio\"><iframe src=\"https://www.youtube.com/embed/eWy3QqiLYEY?rel=0\" width=\"1280\" height=\"720\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"><span data-mce-type=\"bookmark\" style=\"display: inline-block; width: 0px; overflow: hidden; line-height: 0;\" class=\"mce_SELRES_start\">﻿</span></iframe></div>\r\n&nbsp;\r\n<h4>WE ARE DIFFERENT</h4>\r\nWhile every business thinks it’s different, Perrigo UK truly is uniquely positioned within healthcare; operating across branded, store brand and pharmaceutical environments, all supported by our world-class quality manufacturing and distribution. Not to mention our real-world learning pharmacy where we can access incredible insights around customer experience and buying behaviour.\r\nThis means you’ll get the opportunity to grow across a breadth of areas, watch your work come to life and learn something new every day.\r\n<h4>WE MAKE A DIFFERENCE</h4>\r\nAt Perrigo, we are passionate about making a difference to health - relentlessly pursuing better healthcare outcomes and improved quality of life. We do this by making quality healthcare accessible and affordable for people around the world.\r\n\r\nBut this mission goes beyond our customers, we also want to make a difference to the lives of our people at Perrigo and to the communities we operate in. This is why we run an employee wellness programme and give to employee nominated causes through our <a href=\"https://www.perrigo.com/about/perrigo-foundation.aspx\" target=\"_blank\" rel=\"noopener\">Perrigo Company Charitable Foundation</a>.\r\n\r\n&nbsp;\r\n<h4>Our locations</h4>\r\nWe are lucky enough to have approximately 10,000 colleagues doing amazing things in over 30 countries, spread across the globe. This includes the UK and Ireland, but also America, Australia, India, Israel, plus much of Europe.\r\n\r\nThis means a world of job opportunities will be open to you. We encourage internal recruitment and are proud of our commitment to supporting the mobility of our people.\r\n\r\n<strong>In the UK</strong>\r\nWe have 5 sites in the UK across Leeds, Barnsley, Braunton and two in London with our Global Headquarters based in Ireland.\r\n\r\n<strong>Our roles</strong>\r\nColleagues undertake a range of roles from marketing to regulatory and scientific affairs, to manufacturing, engineering and quality, to finance and design. Plus more!\r\n\r\n<strong>Sound interesting? <a href=\"https://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Take a look at our current vacancies to see if we have a job for you.</a></strong>', 'Careers', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2018-08-24 09:52:54', '2018-08-24 08:52:54', '', 41, 'http://perrigo.honeydigital.co.uk/41-revision-v1/', 0, 'revision', '', 0);
