(324, 1, '2018-08-24 12:36:55', '2018-08-24 11:36:55', '<h2 class=\"h3\"><span style=\"color: #283371;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimizing our impact on the environment. </span></h2>\r\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organizations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\r\n\r\nIn the UK, there are four different ways we support our communities\r\n<ol class=\"features-list\">\r\n 	<li><h4>Site charity of the year</h4>\r\nOur employees across each of our sites vote to support a local cause that means a lot to them.</li>\r\n 	<li><h4>Supporting a UK-wide initiative</h4>\r\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.</li>\r\n 	<li><h4>Matching charity activities</h4>\r\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.</li>\r\n 	<li><h4>Volunteer programme</h4>\r\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.</li>\r\n</ol>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-24 12:36:55', '2018-08-24 11:36:55', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
(325, 1, '2018-08-24 12:38:07', '2018-08-24 11:38:07', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimizing our impact on the environment. </span></h2>\r\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organizations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\r\n\r\nIn the UK, there are four different ways we support our communities\r\n<ol class=\"features-list\">\r\n 	<li>\r\n<h4>Site charity of the year</h4>\r\nOur employees across each of our sites vote to support a local cause that means a lot to them.</li>\r\n 	<li>\r\n<h4>Supporting a UK-wide initiative</h4>\r\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.</li>\r\n 	<li>\r\n<h4>Matching charity activities</h4>\r\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.</li>\r\n 	<li>\r\n<h4>Volunteer programme</h4>\r\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.</li>\r\n</ol>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-24 12:38:07', '2018-08-24 11:38:07', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
(326, 1, '2018-08-24 12:52:46', '2018-08-24 11:52:46', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the UK and Ireland\'s No1 player in the niche specialty oral liquid prescription formulations market with manufacturing operations across two MHRA and FDA approved sites in Leeds. </span></h2>\r\n<p class=\"p2\">We manufacture and supply over 150 specialist liquid medicines for leading international branded pharma companies as well as formulations under our own brand – Rosemont. All have a minimum 9-month shelf life with proven stability data available on request.</p>\r\n<p class=\"p2\">The portfolio comprises of licensed and unlicensed (\'specials\') designed to offer a better treatment experience to paediatric and older patient groups who may find tablets too difficult to swallow or where the tablet formulation is the inappropriate strength.</p>\r\n<p class=\"p2\">We have a continual programme of new product development and support education through an innovative range of resources for healthcare professionals and patients. Including a 24-hour helpline for healthcare professionals.</p>\r\n\r\n<h3><span style=\"color: #283371;\">Serving Patient Needs</span></h3>\r\n<p class=\"p1\">Dysphagia or swallowing difficulty preventing patients taking their medication can be associated with many reasons, for example:</p>\r\n\r\n<ul>\r\n 	<li>Stroke</li>\r\n 	<li>Parkinson\'s disease</li>\r\n 	<li>Alzheimer\'s or dementia</li>\r\n 	<li>Old age, loss of muscle tone, less saliva being produced</li>\r\n 	<li>Head and neck cancer</li>\r\n 	<li>Cerebral palsy</li>\r\n 	<li>Learning disability</li>\r\n 	<li>Children unwilling or unable to swallow tablets designed for adults</li>\r\n</ul>\r\n<h3><span style=\"color: #283371;\">Extensive Product Range</span></h3>\r\nOur products can be used across a wide range of therapeutic areas including:\r\n<ul>\r\n 	<li>Anaethesia</li>\r\n 	<li>Cardiovascular</li>\r\n 	<li>Central Nervous System</li>\r\n 	<li>Endocrine</li>\r\n 	<li>Gastro-Intestinal System</li>\r\n 	<li>Infection</li>\r\n 	<li>Malignant Disease &amp; Immunosuppression</li>\r\n 	<li>Musculoskeletal System</li>\r\n 	<li>Nutrition and Blood</li>\r\n 	<li>Obstetrics, Gynaecology and Urinary-Tract Disorders</li>\r\n</ul>\r\n<h3><span style=\"color: #283371;\">The Rosemont Commitment</span></h3>\r\n<ul>\r\n 	<li><strong>Extensive Product range</strong> – liquid medicines for many therapeutic areas including cardiovascular, endocrine, central nervous system, gastro-intestinal and musculo-skeletal.</li>\r\n 	<li><strong>Exceptional Product quality</strong> – we produce all our medicines to the same exacting GMP standards, so whether they are licensed products or \'Specials\' the quality will be the same through batch manufacturing.</li>\r\n 	<li><strong>Reliable delivery</strong> – delivery within 48 hours in over 99% of orders and within 24 hours available on request.</li>\r\n 	<li><strong>Outstanding Customer Service</strong> – dedicated and knowledgeable customer service team who provide expert support for our customers</li>\r\n 	<li><strong>Proven Shelf life</strong> – for both licensed and \'Specials\'. Generally our \"Specials\" have a minimum 9 month shelf life.</li>\r\n 	<li><strong>Award-winning Educational Resources</strong> – we are a key partner in the education of healthcare professionals in the field of medicines management in patients with dysphagia or swallowing difficulties. We have a wide range of resources designed to help healthcare professionals deliver the best possible care. Also, extensively researched patient information leaflets.</li>\r\n 	<li><strong>Healthcare professional advice service</strong> – 24 hour professional advice line available 365 days a year.</li>\r\n</ul>', 'Rosemont Pharmaceuticals', '', 'inherit', 'closed', 'closed', '', '37-revision-v1', '', '', '2018-08-24 12:52:46', '2018-08-24 11:52:46', '', 37, 'http://perrigo.honeydigital.co.uk/37-revision-v1/', 0, 'revision', '', 0),
(327, 1, '2018-08-24 12:56:18', '2018-08-24 11:56:18', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the UK and Ireland\'s No1 player in the niche specialty oral liquid prescription formulations market with manufacturing operations across two MHRA and FDA approved sites in Leeds. </span></h2>\r\n<p class=\"p2\">We manufacture and supply over 150 specialist liquid medicines for leading international branded pharma companies as well as formulations under our own brand – Rosemont. All have a minimum 9-month shelf life with proven stability data available on request.</p>\r\n<p class=\"p2\">The portfolio comprises of licensed and unlicensed (\'specials\') designed to offer a better treatment experience to paediatric and older patient groups who may find tablets too difficult to swallow or where the tablet formulation is the inappropriate strength.</p>\r\n<p class=\"p2\">We have a continual programme of new product development and support education through an innovative range of resources for healthcare professionals and patients. Including a 24-hour helpline for healthcare professionals.</p>', 'Rosemont Pharmaceuticals', '', 'inherit', 'closed', 'closed', '', '37-revision-v1', '', '', '2018-08-24 12:56:18', '2018-08-24 11:56:18', '', 37, 'http://perrigo.honeydigital.co.uk/37-revision-v1/', 0, 'revision', '', 0),
