(361, 1, '2018-08-29 11:44:49', '2018-08-29 10:44:49', '<h2 class=\"h2\"><span style=\"color: #283371; font-weight: normal;\">Perrigo is one of the fastest growing healthcare companies in the world, and an in-dustry leader in pharmaceutical technologies. We develop, manufacture and dis-tribute over-the-counter (OTC) branded and non-branded consumer goods, as well as prescription (Rx) pharmaceuticals.</span></h2>\r\nYou may have heard of some of our iconic household brands including Nytol, Solpadeine, Tiger Balm, NiQuitin, Jungle Formula, Dermalex, XLS-Medical and family favourite TCP. We also produce over 160 liquid medicines helping to treat a variety of conditions, such as musculoskeletal and joint diseases, cardiovascular disease, infections, swallowing problems and more.\r\n\r\nAt Perrigo, we are unapologetically passionate about making a difference to health - relentlessly making quality healthcare products accessible and affordable for people around the world.', 'About Us', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2018-08-29 11:44:49', '2018-08-29 10:44:49', '', 8, 'http://perrigo.honeydigital.co.uk/8-revision-v1/', 0, 'revision', '', 0),
(362, 1, '2018-08-29 11:45:01', '2018-08-29 10:45:01', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Perrigo is one of the fastest growing healthcare companies in the world, and an in-dustry leader in pharmaceutical technologies. We develop, manufacture and dis-tribute over-the-counter (OTC) branded and non-branded consumer goods, as well as prescription (Rx) pharmaceuticals.</span></h2>\r\nYou may have heard of some of our iconic household brands including Nytol, Solpadeine, Tiger Balm, NiQuitin, Jungle Formula, Dermalex, XLS-Medical and family favourite TCP. We also produce over 160 liquid medicines helping to treat a variety of conditions, such as musculoskeletal and joint diseases, cardiovascular disease, infections, swallowing problems and more.\r\n\r\nAt Perrigo, we are unapologetically passionate about making a difference to health - relentlessly making quality healthcare products accessible and affordable for people around the world.', 'About Us', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2018-08-29 11:45:01', '2018-08-29 10:45:01', '', 8, 'http://perrigo.honeydigital.co.uk/8-revision-v1/', 0, 'revision', '', 0),
(363, 1, '2018-08-29 11:45:29', '2018-08-29 10:45:29', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">From our beginning in 1887, as a packager of generic home remedies, Perrigo has transformed itself into the world’s largest manufacturer of OTC products and suppli-er of infant formulas for the store brand market. </span></h2>\r\n<div class=\"aspect-ratio\"><iframe src=\"//www.youtube.com/embed/YHxP1AOW028\" width=\"450\" height=\"253\" frameborder=\"0\"></iframe></div>', 'Our Story', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-08-29 11:45:29', '2018-08-29 10:45:29', '', 10, 'http://perrigo.honeydigital.co.uk/10-revision-v1/', 0, 'revision', '', 0),
(364, 1, '2018-08-29 11:46:10', '2018-08-29 10:46:10', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Following its acquisition by Perrigo in August 2014, Warman-Freed has become the UK’s first ‘learning pharmacy’, seeking to provide insights and intelligence into the day-to-day running of a typical pharmacy operation.</span></h2>\r\n<p class=\"p2\">The Learning Pharmacy allows us to gather and share real world learning. It presents a unique opportunity to learn about pharmacy from within; we can learn from real patients, behaviours and situations and then share this learning back with our pharmacy colleagues across the UK and Ireland.</p>\r\nAdding a fully-functioning retail pharmacy to our business, is part of our commitment to Pharmacy and empowering pharmacists to be strong pillars of the community. We look to provide them with the support and products to grow their business and make greater efficiencies for the NHS. Our aim is to help Pharmacy thrive, leveraging the collective expertise at Perrigo and in partnership with pharmacies across the UK.\r\n\r\nWarman-Freed is located in Golders Green, North London and is open 8.30am – Midnight every day of the year.', 'Warman-Freed Learning Pharmacy', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-08-29 11:46:10', '2018-08-29 10:46:10', '', 16, 'http://perrigo.honeydigital.co.uk/16-revision-v1/', 0, 'revision', '', 0),
(365, 1, '2018-08-29 11:46:38', '2018-08-29 10:46:38', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">At Perrigo, our pursuit of quality is not limited to the operational level, but is valued at every level of our business.</span></h2>\r\nOur Quality Management System, which is based on current industry and regulatory concepts for a modern quality management system, ensures that quality is fully integrated into our global business processes.\r\n\r\nWhy do we have this focus on quality? The answer is simple: we want to ensure that every Perrigo product, no matter where in the world it is produced, meets the high expectations for safety and effectiveness held by our customers, consumers, employees, regulatory agencies and shareowners.\r\n\r\nWe will continue to focus on quality as we expand our business across the globe. Our stakeholders and customers expect this from us; we expect this from ourselves; and our ability to produce \"Quality Affordable Healthcare Products™\" for consumers around the world depends on it.\r\n<h4>Conducting Ourselves with Integrity</h4>\r\n<a href=\"http://perrigo.investorroom.com/download/Code+of+Conduct.pdf\">We Are Responsible: Our Code of Conduct</a> helps all of us at Perrigo act with integrity and safeguard our company\'s reputation. It contains the global standards we must follow to ensure we uphold our core values, and it provides principles to guide our conduct and help us do what is right. The code applies to all employees, officers and directors, as well as those working on Perrigo\'s behalf, such as consultants, agents and business partners.\r\n\r\nWe also expect our suppliers to adhere to our high quality and ethical standards. That is why we have a Supplier Code of Conduct to guide their actions.', 'Our Commitment  to Quality', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2018-08-29 11:46:38', '2018-08-29 10:46:38', '', 20, 'http://perrigo.honeydigital.co.uk/20-revision-v1/', 0, 'revision', '', 0),
(366, 1, '2018-08-29 11:47:15', '2018-08-29 10:47:15', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the fastest growing and a top 5 consumer healthcare company in the UK &amp; Ireland.</span></h2>\r\nThe Branded Consumer Healthcare areas of Perrigo UK &amp; Ireland specialises in delivering innovative over-the-counter (OTC) treatments that can be purchased without a prescription. We are committed to making a difference to health, by helping people lead healthier lives and positively affecting their wellbeing. Our product portfolio includes iconic brands such as Solpadeine, Nytol, TCP, Jungle Formula, complemented by breakthrough innovations for weight loss (XLS-Medical &amp; XLS-Nutrition) and skin health (Dermalex).', 'Our Brands', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2018-08-29 11:47:15', '2018-08-29 10:47:15', '', 35, 'http://perrigo.honeydigital.co.uk/35-revision-v1/', 0, 'revision', '', 0),
