(429, 1, '2018-08-30 09:12:03', '2018-08-30 08:12:03', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the fastest growing and a top 5 consumer healthcare company in the UK &amp; Ireland.</span></h2>\r\nThe Branded Consumer Healthcare areas of Perrigo UK &amp; Ireland specialises in delivering innovative over-the-counter (OTC) treatments that can be purchased without a prescription. We are committed to making a difference to health, by helping people lead healthier lives and positively affecting their wellbeing. Our product portfolio includes iconic brands such as Solpadeine, Nytol, TCP, Jungle Formula, complemented by breakthrough innovations for weight loss (XLS-Medical &amp; XLS-Nutrition) and skin health (Dermalex).', 'Our Brands', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2018-08-30 09:12:03', '2018-08-30 08:12:03', '', 35, 'http://perrigo.honeydigital.co.uk/35-revision-v1/', 0, 'revision', '', 0),
