(435, 1, '2018-08-30 10:57:48', '2018-08-30 09:57:48', '<h2 class=\"h4\" style=\"font-weight: normal;\"><span style=\"color: #283371;\">We live by <a style=\"color: #283371;\" href=\"http://perrigo.honeydigital.co.uk/about-us/our-vision-values/\">our values</a> of <strong>Respect</strong>: we demonstrate the value we hold for one another, <strong>Integrity</strong>: we do what is right and <strong>Responsibility</strong>: we hold ourselves accountable for our actions.</span></h2>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>\r\n\r\n<div class=\"aspect-ratio\"><iframe src=\"https://www.youtube.com/embed/eWy3QqiLYEY?rel=0\" width=\"1280\" height=\"720\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"><span data-mce-type=\"bookmark\" style=\"display: inline-block; width: 0px; overflow: hidden; line-height: 0;\" class=\"mce_SELRES_start\">﻿</span></iframe></div>\r\n&nbsp;\r\n<ul class=\"flair\">\r\n 	<li>\r\n<h4>We are different</h4>\r\nWhile every business thinks it’s different, Perrigo UK truly is uniquely positioned within healthcare; operating across branded, store brand and pharmaceutical environments, all supported by our world-class quality manufacturing and distribution. Not to mention our real-world learning pharmacy where we can access incredible insights around customer experience and buying behaviour.\r\nThis means you’ll get the opportunity to grow across a breadth of areas, watch your work come to life and learn something new every day.</li>\r\n 	<li>\r\n<h4>We make a difference</h4>\r\nAt Perrigo, we are passionate about making a difference to health - relentlessly pursuing better healthcare outcomes and improved quality of life. We do this by making quality healthcare accessible and affordable for people around the world.\r\n\r\nBut this mission goes beyond our customers, we also want to make a difference to the lives of our people at Perrigo and to the communities we operate in. This is why we run an employee wellness programme and give to employee nominated causes through our <a href=\"https://www.perrigo.com/about/perrigo-foundation.aspx\" target=\"_blank\" rel=\"noopener\">Perrigo Company Charitable Foundation</a>.</li>\r\n</ul>', 'Careers', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2018-08-30 10:57:48', '2018-08-30 09:57:48', '', 41, 'http://perrigo.honeydigital.co.uk/41-revision-v1/', 0, 'revision', '', 0),
