(442, 1, '2018-08-30 11:10:53', '2018-08-30 10:10:53', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">The team at Perrigo has a wealth of experience in quoting for, winning and implementing significant Contract Manufacturing opportunities.</span></h2>\r\n<p class=\"p2\">Having collaborated with major blue chip brands for over 4 decades, in traditional “toll” manufacturing, contract new product development and supply from in-house Intellectual Property, Perrigo’s support structure is geared to delivering projects on time and in full. Brands can be assured of a confidential and professional service, with an experienced team and a facility focused on delivering quality affordable healthcare products.</p>', 'Multi-format Pharmaceutical  Contract Manufacturing & Packing', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2018-08-30 11:10:53', '2018-08-30 10:10:53', '', 27, 'http://perrigo.honeydigital.co.uk/27-revision-v1/', 0, 'revision', '', 0),
