(444, 1, '2018-08-30 11:15:04', '2018-08-30 10:15:04', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the UK and Ireland\'s No1 player in the niche specialty oral liquid prescription formulations market with manufacturing operations across two MHRA and FDA approved sites in Leeds. </span></h2>\r\n<p class=\"p2\">We manufacture and supply over 150 specialist liquid medicines for leading international branded pharma companies as well as formulations under our own brand – Rosemont. All have a minimum 9-month shelf life with proven stability data available on request.</p>\r\n<p class=\"p2\">The portfolio comprises of licensed and unlicensed (\'specials\') designed to offer a better treatment experience to paediatric and older patient groups who may find tablets too difficult to swallow or where the tablet formulation is the inappropriate strength.</p>\r\n<p class=\"p2\">We have a continual programme of new product development and support education through an innovative range of resources for healthcare professionals and patients. Including a 24-hour helpline for healthcare professionals.</p>', 'Rosemont Pharmaceuticals', '', 'inherit', 'closed', 'closed', '', '37-revision-v1', '', '', '2018-08-30 11:15:04', '2018-08-30 10:15:04', '', 37, 'http://perrigo.honeydigital.co.uk/37-revision-v1/', 0, 'revision', '', 0),
(445, 1, '2018-08-30 11:32:11', '2018-08-30 10:32:11', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Following its acquisition by Perrigo in August 2014, Warman-Freed has become the UK’s first ‘learning pharmacy’, seeking to provide insights and intelligence into the day-to-day running of a typical pharmacy operation.</span></h2>\r\n<p class=\"p2\">The Learning Pharmacy allows us to gather and share real world learning. It presents a unique opportunity to learn about pharmacy from within; we can learn from real patients, behaviours and situations and then share this learning back with our pharmacy colleagues across the UK and Ireland.</p>\r\nAdding a fully-functioning retail pharmacy to our business, is part of our commitment to Pharmacy and empowering pharmacists to be strong pillars of the community. We look to provide them with the support and products to grow their business and make greater efficiencies for the NHS. Our aim is to help Pharmacy thrive, leveraging the collective expertise at Perrigo and in partnership with pharmacies across the UK.\r\n\r\nWarman-Freed is located in Golders Green, North London and is open 8.30am – Midnight every day of the year.', 'The Learning Pharmacy', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-08-30 11:32:11', '2018-08-30 10:32:11', '', 16, 'http://perrigo.honeydigital.co.uk/16-revision-v1/', 0, 'revision', '', 0),
