f our people at Perrigo and to the communities we operate in. This is why we run an employee wellness programme and give to employee nominated causes through our <a href=\"https://www.perrigo.com/about/perrigo-foundation.aspx\" target=\"_blank\" rel=\"noopener\">Perrigo Company Charitable Foundation</a>.\r\n\r\n<hr />\r\n\r\n</li>\r\n</ul>\r\n<h4>Our locations</h4>\r\nWe are lucky enough to have approximately 10,000 colleagues doing amazing things in over 30 countries, spread across the globe. This includes the UK and Ireland, but also America, Australia, India, Israel, plus much of Europe.\r\n\r\nThis means a world of job opportunities will be open to you. We encourage internal recruitment and are proud of our commitment to supporting the mobility of our people.\r\n\r\n<strong>In the UK</strong>\r\nWe have 5 sites in the UK across Leeds, Barnsley, Braunton and two in London with our Global Headquarters based in Ireland.\r\n<h4>Our roles</h4>\r\nColleagues undertake a range of roles from marketing to regulatory and scientific affairs, to manufacturing, engineering and quality, to finance and design. Plus more!\r\n\r\n<span style=\"color: #283371;\"><strong>Sound interesting? Take a look at our current vacancies to see if we have a job for you.</strong></span>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>', 'Careers', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2018-08-30 11:44:55', '2018-08-30 10:44:55', '', 41, 'http://perrigo.honeydigital.co.uk/41-revision-v1/', 0, 'revision', '', 0),
(454, 1, '2018-08-30 11:45:45', '2018-08-30 10:45:45', '<h2 class=\"h4\" style=\"font-weight: normal;\"><span style=\"color: #283371;\">We live by <a style=\"color: #283371;\" href=\"http://perrigo.honeydigital.co.uk/about-us/our-vision-values/\">our values</a> of <strong>Respect</strong>: we demonstrate the value we hold for one another, <strong>Integrity</strong>: we do what is right and <strong>Responsibility</strong>: we hold ourselves accountable for our actions.</span></h2>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>\r\n\r\n<div class=\"aspect-ratio\"><iframe src=\"https://www.youtube.com/embed/eWy3QqiLYEY?rel=0\" width=\"1280\" height=\"720\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"><span data-mce-type=\"bookmark\" style=\"display: inline-block; width: 0px; overflow: hidden; line-height: 0;\" class=\"mce_SELRES_start\">﻿</span></iframe></div>\r\n&nbsp;\r\n<ul class=\"flair\">\r\n 	<li>\r\n<h4>We are different</h4>\r\nWhile every business thinks it’s different, Perrigo UK truly is uniquely positioned within healthcare; operating across branded, store brand and pharmaceutical environments, all supported by our world-class quality manufacturing and distribution. Not to mention our real-world learning pharmacy where we can access incredible insights around customer experience and buying behaviour.\r\nThis means you’ll get the opportunity to grow across a breadth of areas, watch your work come to life and learn something new every day.</li>\r\n 	<li>\r\n<h4>We make a difference</h4>\r\nAt Perrigo, we are passionate about making a difference to health - relentlessly pursuing better healthcare outcomes and improved quality of life. We do this by making quality healthcare accessible and affordable for people around the world.\r\n\r\nBut this mission goes beyond our customers, we also want to make a difference to the lives of our people at Perrigo and to the communities we operate in. This is why we run an employee wellness programme and give to employee nominated causes through our <a href=\"https://www.perrigo.com/about/perrigo-foundation.aspx\" target=\"_blank\" rel=\"noopener\">Perrigo Company Charitable Foundation</a>.</li>\r\n</ul>\r\n\r\n<hr />\r\n\r\n<h4>Our locations</h4>\r\nWe are lucky enough to have approximately 10,000 colleagues doing amazing things in over 30 countries, spread across the globe. This includes the UK and Ireland, but also America, Australia, India, Israel, plus much of Europe.\r\n\r\nThis means a world of job opportunities will be open to you. We encourage internal recruitment and are proud of our commitment to supporting the mobility of our people.\r\n\r\n<strong>In the UK</strong>\r\nWe have 5 sites in the UK across Leeds, Barnsley, Braunton and two in London with our Global Headquarters based in Ireland.\r\n<h4>Our roles</h4>\r\nColleagues undertake a range of roles from marketing to regulatory and scientific affairs, to manufacturing, engineering and quality, to finance and design. Plus more!\r\n\r\n<span style=\"color: #283371;\"><strong>Sound interesting? Take a look at our current vacancies to see if we have a job for you.</strong></span>\r\n<p style=\"text-align: center;\"><a class=\"secondary-btn\" href=\"http://jobs.jobvite.com/perrigocareers\" target=\"_blank\" rel=\"noopener\">Visit our careers site</a></p>', 'Careers', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2018-08-30 11:45:45', '2018-08-30 10:45:45', '', 41, 'http://perrigo.honeydigital.co.uk/41-revision-v1/', 0, 'revision', '', 0),
(455, 1, '2018-08-30 11:49:07', '2018-08-30 10:49:07', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">At Perrigo, we are committed to conducting business with integrity, fostering a safe work environment, caring for our communities and minimising our impact on the environment. </span></h2>\r\n<p class=\"p2\">Perrigo views Corporate Social Responsibility (CSR) not only as measuring the impact of our global operations, but also as recognising our efforts to ensure that how we achieve results is just as impactful as the results themselves. We have a long history of environmentally sound and efficient operations, safe and healthy working conditions and active participation in the communities where we work.</p>\r\n<p class=\"p2\">We believe in conducting business through our Core Values of Integrity, Respect and Responsibility. We believe our commitments to sustainability and our ability to recognise the impact we have on our environment has contributed greatly to our ability to thrive in today\'s business landscape.</p>\r\n\r\n<h3>The Perrigo Foundation</h3>\r\nThe Perrigo Company Charitable Foundation is a private, non-profit organisation wholly funded by Perrigo Company plc. The Foundation\'s mission is to provide financial support to non-profit organisations that enhance the health, well-being and education of individuals and families in communities that Perrigo serves.\r\n\r\nAs part of Perrigo’s social responsibility plan, every country receives a budget every year to make a difference to our communities.\r\n\r\nIn the UK, there are four different ways we support our communities\r\n<ol class=\"features-list\">\r\n 	<li>\r\n<h4>Site charity of the year</h4>\r\nOur employees across each of our sites vote to support a local cause that means a lot to them.</li>\r\n 	<li>\r\n<h4>Supporting a UK-wide initiative</h4>\r\nOur employees across the UK vote to support one charity and organise a programme of events and activities to support them.</li>\r\n 	<li>\r\n<h4>Matching charity activities</h4>\r\nWe know that we have a lot of employees who are very passionate about a charity close to their hearts and want to help support this, which is why we offer a charity matching scheme.</li>\r\n 	<li>\r\n<h4>Volunteer programme</h4>\r\nIf our people volunteer their time outside of work to a charitable organisation, we donate money towards that charity.</li>\r\n</ol>', 'Corporate Social Responsibility', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-08-30 11:49:07', '2018-08-30 10:49:07', '', 18, 'http://perrigo.honeydigital.co.uk/18-revision-v1/', 0, 'revision', '', 0),
