(468, 1, '2018-08-31 10:16:05', '2018-08-31 09:16:05', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">We are the fastest growing and a top 5 consumer healthcare company in the UK &amp; Ireland.</span></h2>\r\nThe Branded Consumer Healthcare areas of Perrigo UK &amp; Ireland specialises in delivering innovative over-the-counter (OTC) treatments that can be purchased without a prescription. We are committed to making a difference to health, by helping people lead healthier lives and positively affecting their wellbeing. Our product portfolio includes iconic brands such as Solpadeine, Nytol, TCP, Jungle Formula, complemented by breakthrough innovations for weight loss (XLS-Medical &amp; XLS-Nutrition) and skin health (Dermalex).', 'Our Brands', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2018-08-31 10:16:05', '2018-08-31 09:16:05', '', 35, 'http://perrigo.honeydigital.co.uk/35-revision-v1/', 0, 'revision', '', 0),
(469, 1, '2018-08-31 10:17:58', '2018-08-31 09:17:58', '<h2 class=\"h4\"><span style=\"color: #283371; font-weight: normal;\">Following its acquisition by Perrigo in August 2014, Warman-Freed has become the UK’s first ‘learning pharmacy’, seeking to provide insights and intelligence into the day-to-day running of a typical pharmacy operation.</span></h2>\r\n<p class=\"p2\">The Learning Pharmacy allows us to gather and share real world learning. It presents a unique opportunity to learn about pharmacy from within; we can learn from real patients, behaviours and situations and then share this learning back with our pharmacy colleagues across the UK and Ireland.</p>\r\nAdding a fully-functioning retail pharmacy to our business, is part of our commitment to Pharmacy and empowering pharmacists to be strong pillars of the community. We look to provide them with the support and products to grow their business and make greater efficiencies for the NHS. Our aim is to help Pharmacy thrive, leveraging the collective expertise at Perrigo and in partnership with pharmacies across the UK.\r\n\r\nWarman-Freed is located in Golders Green, North London and is open 8.30am – Midnight every day of the year.', 'The Learning Pharmacy', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-08-31 10:17:58', '2018-08-31 09:17:58', '', 16, 'http://perrigo.honeydigital.co.uk/16-revision-v1/', 0, 'revision', '', 0),
